me@7.x:rich-text#answer1","blocks":[],"component":"vtex.rich-text@0.16.0\u002Findex","composition":"blocks","contentMapId":"8kwj4NrGMBc4M26kebWcnf","hasContentSchema":true,"hydration":"always","implements":["vtex.rich-text@0.x:rich-text"],"preview":null,"props":{"text":"","textAlignment":"LEFT","textPosition":"LEFT","blockClass":"answer-home"},"render":"server","title":"Texto Hidden","track":[],"content":{"text":"## [Maquiagem](https:\u002F\u002Fwww.oceane.com.br\u002Fmaquiagem)\n\nOs seus queridinhos de maquiagem! Para fazer uma boa make, tudo o que você precisa são produtos de qualidade e as melhores dicas de quem entende do assunto — isso aí, nós mesmos!\n\nAqui você encontra sombras, contornos, lip gloss, blushes, máscaras de cílios, máscaras de sobrancelha, iluminadores e muito mais para uma produção completa que durará por muitas horas. Além das makes, confira também os [acessórios de maquiagem](https:\u002F\u002Fwww.oceane.com.br\u002Fmaquiagem\u002Facessorios) que não podem faltar na sua penteadeira:\n\n-   [Rosto](https:\u002F\u002Fwww.oceane.com.br\u002Fmaquiagem\u002Frosto);\n    \n-   [Boca](https:\u002F\u002Fwww.oceane.com.br\u002Fmaquiagem\u002Fboca);\n    \n-   [Olhos](https:\u002F\u002Fwww.oceane.com.br\u002Fmaquiagem\u002Folhos);\n    \n-   [Paleta](https:\u002F\u002Fwww.oceane.com.br\u002Fmaquiagem\u002Fpaleta);\n    \n-   [Pincéis](https:\u002F\u002Fwww.oceane.com.br\u002Fmaquiagem\u002Fpinceis);\n    \n-   [Esponjas de maquiagem](https:\u002F\u002Fwww.oceane.com.br\u002Fmaquiagem\u002Fesponja-de-maquiagem);\n    \n-   [Demaquilantes](https:\u002F\u002Fwww.oceane.com.br\u002Fmaquiagem\u002Fdemaquilante);\n    \n-   [Nécessaire](https:\u002F\u002Fwww.oceane.com.br\u002Fmaquiagem\u002Fnecessaire);\n    \n-   [Kits de maquiagem](https:\u002F\u002Fwww.oceane.com.br\u002Fmaquiagem\u002Fkits-de-maquiagem).\n    \n\n## [Collabs](https:\u002F\u002Fwww.oceane.com.br\u002Fcollabs)\n\nComo a gente sabe que vocês AMAM, nos juntamos com as melhores para criar **collabs incríveis de maquiagem e acessórios**. Tem pincel de maquiagem, paleta de sombras, contorno, batom, fixador de maquiagem, blush, brilho labial, caneta delineadora, lápis de olho, blush em bastão e até máscara facial de argila. Confira todos os itens das nossas musas:\n\n-   [Mariana Saad by Océane](https:\u002F\u002Fwww.oceane.com.br\u002Fmariana-saad-by-oceane);\n    \n-   [Nádia Tambasco by Océane](https:\u002F\u002Fwww.oceane.com.br\u002Fnadia-tambasco-by-oceane);\n    \n-   [Marília Mendonça by Océane](https:\u002F\u002Fwww.oceane.com.br\u002Fcolecao-de-produto-marilia-mendonca-by-oceane);\n    \n-   [Larissa Manoela by Océane](https:\u002F\u002Fwww.oceane.com.br\u002Flarissa-manoela-by-oceane);\n    \n-   [Sabrina Sato by Océane](https:\u002F\u002Fwww.oceane.com.br\u002Fsabrina-sato-by-oceane).\n    \n\n## [Skincare](https:\u002F\u002Fwww.oceane.com.br\u002Fskincare)\n\nSe tem uma coisa que a gente entende são de itens de cuidado com a pele. Temos uma seleção incrível cheia de ativos de skincare que cuidam da sua face no todo. São produtos com retinol, ácido hialurônico, vitamina C, ácido salicílico, ácido glicólico e muitos outros.\n\nAs opções vão desde os **cremes hidratantes até os séruns, brumas e tônicos poderosos**. Inclusive, se está procurando por [acessórios de skincare](https:\u002F\u002Fwww.oceane.com.br\u002Fskincare\u002Facessorios), produtos para limpeza do rosto e corpo, para melhorar a textura da sua pele, diminuir espinhas, estimular a produção de colágeno e até deixar a face e lábios super hidratados, aqui é o lugar certo:\n\n-   [Esponja Facial](https:\u002F\u002Fwww.oceane.com.br\u002Fskincare\u002Fesponja-facial);\n    \n-   [Lábios](https:\u002F\u002Fwww.oceane.com.br\u002Fskincare\u002Flabios);\n    \n-   [Mãos](https:\u002F\u002Fwww.oceane.com.br\u002Fskincare\u002Fmaos);\n    \n-   [Máscara facial](https:\u002F\u002Fwww.oceane.com.br\u002Fskincare\u002Fmascara-facial);\n    \n-   [Massageador facial](https:\u002F\u002Fwww.oceane.com.br\u002Fskincare\u002Fmassageador-facial);\n    \n-   [Olhos](https:\u002F\u002Fwww.oceane.com.br\u002Fskincare\u002Folhos);\n    \n-   [Pés](https:\u002F\u002Fwww.oceane.com.br\u002Fskincare\u002Fpes);\n    \n-   [Rosto](https:\u002F\u002Fwww.oceane.com.br\u002Fskincare\u002Frosto);\n    \n-   [Kits para skincare](https:\u002F\u002Fwww.oceane.com.br\u002Fskincare\u002Fkits-para-skincare);\n    \n-   [Aparelho de limpeza facial](https:\u002F\u002Fwww.oceane.com.br\u002Fskincare\u002Faparelho-de-limpeza-facial);\n    \n-   [Séruns de tratamento](https:\u002F\u002Fwww.oceane.com.br\u002Fskincare\u002Fseruns-de-tratamento);\n    \n-   [Corpo e banho](https:\u002F\u002Fwww.oceane.com.br\u002Fskincare\u002Fcorpo-e-banho);\n    \n-   [Solução antiacne em spray](https:\u002F\u002Fwww.oceane.com.br\u002Fskincare\u002Fsolucao-antiacne-em-spray).\n    \n\n## [Cabelo](https:\u002F\u002Fwww.oceane.com.br\u002Fcabelos)\n\nCabelos arrumados, hidratados e limpinhos by Océane! Com os nossos produtos e [acessórios para cabelo](https:\u002F\u002Fwww.oceane.com.br\u002Fcabelos\u002Facessorios), não tem mais desculpa para não cuidar dos fios, viu? Encontre desde shampoo e condicionador até [maquiagem capilar](https:\u002F\u002Fwww.oceane.com.br\u002Fcabelos\u002Fmaquiagem-capilar) para cabelos grisalhos e produtos para o seu cronograma capilar.\n\n-   [Shampoo](https:\u002F\u002Fwww.oceane.com.br\u002Fcabelos\u002Fshampoo);\n    \n-   [Condicionador](https:\u002F\u002Fwww.oceane.com.br\u002Fcabelos\u002Fcondicionador);\n    \n-   [Máscara capilar](https:\u002F\u002Fwww.oceane.com.br\u002Fcabelos\u002Fmascara-capilar);\n    \n-   [Kits para cabelo](https:\u002F\u002Fwww.oceane.com.br\u002Fcabelos\u002Fkits-para-cabelo);\n    \n-   [Escova de cabelo](https:\u002F\u002Fwww.oceane.com.br\u002Fcabelos\u002Fescova-de-cabelo);\n    \n-   [Finalizador e protetor térmico](https:\u002F\u002Fwww.oceane.com.br\u002Fcabelos\u002Ffinalizador-e-protetor-termico).\n    \n\n## [Bem-estar e organização](https:\u002F\u002Fwww.oceane.com.br\u002Fbem-estar-e-organizacao)\n\nNem só de make, skincare e produtos para o cabelo a gente vive, não é mesmo? Também contamos com uma linha incrível totalmente focada no seu [bem-estar](https:\u002F\u002Fwww.oceane.com.br\u002Fbem-estar-e-organizacao\u002Fbem-estar) (de vida mesmo e até sexual 😉) e organização para viagens — a gente ama!\n\nQueremos cuidar de você em todas as áreas, por isso, temos uma seleção com itens que vão desde o seu momento de [aromaterapia](https:\u002F\u002Fwww.oceane.com.br\u002Fbem-estar-e-organizacao\u002Faromaterapia), até os **vibradores que te deixarão nas nuvens**. Vem ver:\n\n-   [Velas perfumadas](https:\u002F\u002Fwww.oceane.com.br\u002Fbem-estar-e-organizacao\u002Fvelas-perfumadas);\n    \n-   [Organizador de mala](https:\u002F\u002Fwww.oceane.com.br\u002Fbem-estar-e-organizacao\u002Forganizador-de-mala);\n    \n-   [Luminária de mesa](https:\u002F\u002Fwww.oceane.com.br\u002Fbem-estar-e-organizacao\u002Fluminaria-de-mesa);\n    \n-   [Bem-estar sexual](https:\u002F\u002Fwww.oceane.com.br\u002Fbem-estar-e-organizacao\u002Fbem-estar-sexual);\n    \n-   [Kits bem-estar e organização](https:\u002F\u002Fwww.oceane.com.br\u002Fbem-estar-e-organizacao\u002Fkits-bem-estar-e-organizacao).\n    \n\n## [Océane Edition](https:\u002F\u002Fwww.oceane.com.br\u002Foceane-edition)\n\nAs makes e as esponjas de maquiagem que serão suas queridinhas! Desenvolvidas com a melhor tecnologia de Océane, essa coleção dará um resultado de arrasar para as suas produções. São itens super pigmentados, práticos e modernos para delinear, contornar, iluminar, dar cor e destacar seus melhores traços.\n\n## [Veganos](https:\u002F\u002Fwww.oceane.com.br\u002Fprodutos-veganos)\n\nTodos os tipos de produtos sem ingredientes de origem animal para você não se preocupar com nada. São itens de maquiagem, skincare e haircare com selo vegano e cruelty free: iluminador líquido, máscara facial, gel de limpeza facial, blush cremoso, máscara de tratamento capilar e muito mais!\n\n## [Lançamentos](https:\u002F\u002Fwww.oceane.com.br\u002Flancamentos-oceane)\n\nQuer ficar por dentro de todos os lançamentos da Océane e das **collabs com a Mari Saad, Nádia Tambasco** e várias outras? Então, aqui é o lugar certo para encontrar tudo em primeira mão! Acesse também os kits promocionais e arrase na make e nos cuidados do dia a dia com o que temos de mais novo.\n\n## [Presentes](https:\u002F\u002Fwww.oceane.com.br\u002Fpresentes)\n\nTem algo melhor do que presentear quem a gente gosta com produtos e maquiagens que amamos e sabemos da qualidade incrível que possui? Confie em nós quando dizemos que sua amiga vai amar ganhar aquele kit de make ou produtinhos para a pele. E o melhor? Você consegue selecionar tudo por preço para caber no seu orçamento:\n\n-   [Itens de até R$ 50](https:\u002F\u002Fwww.oceane.com.br\u002Fpresentes\u002Fate-50-reais);\n    \n-   [Itens de até R$ 100](https:\u002F\u002Fwww.oceane.com.br\u002Fpresentes\u002Fate-100-reais);\n    \n-   [Itens de até R$ 150](https:\u002F\u002Fwww.oceane.com.br\u002Fpresentes\u002Fate-150-reais);\n    \n-   [Itens de até R$ 200](https:\u002F\u002Fwww.oceane.com.br\u002Fpresentes\u002Fate-200-reais);\n    \n-   [Itens de até R$ 300](https:\u002F\u002Fwww.oceane.com.br\u002Fpresentes\u002Fate-300-reais);\n    \n-   [Itens acima de R$ 300](https:\u002F\u002Fwww.oceane.com.br\u002Fpresentes\u002Facima-de-300-reais).\n    \n\n## [Ofertas](https:\u002F\u002Fwww.oceane.com.br\u002Fofertas)\n\nOuvimos falar em oferta? Isso aí, tudo da Océane em promoção para você! Agora é hora de comprar [3 makes por R$ 99](https:\u002F\u002Fwww.oceane.com.br\u002F3makespor99) ou produtos de skincare e haircare por um precinho incrível!\n\nEscolha o seu preferido: kits de maquiagem, batom líquido, creme para área dos olhos, bruma hidratante, loção secativa para espinha, produtos para cabelos, massageadores faciais e mais. Qual item você colocará no carrinho primeiro?\n\n## [Cupons](https:\u002F\u002Fwww.oceane.com.br\u002Fcupom-de-desconto-oceane)\n\nTem uma coisa que a gente ama tanto quanto o próprio desconto: os cupons! Sabe aquela sensação perfeita de fechar o carrinho de compras com tudo o que você quer e acabar pagando mais barato por causa daquele cupom perfeito?\n\nFoi pensando justamente nisso que separamos **alguns cupons de descontos ativos do nosso site** em um só lugar. Assim, garantimos transparência e economia para você."},"contentIds":["8kwj4NrGMBc4M26kebWcnf~h7YZVTfMYV2fqSJ3rFN5Ta"]},"store.home\u002F$before_header.full\u002Fheader-layout.desktop\u002Fsticky-layout#2-desktop\u002Fflex-layout.row#4-desktop\u002Fsearch-bar\u002Fautocomplete-result-list\u002Fproduct-summary":{"before":[],"around":[],"after":[],"blockId":"oceane.store-theme@7.x:product-summary.shelf#search","blocks":[{"blockId":"oceane.store-theme@7.x:flex-layout.row#shelf-info","extensionPointId":"flex-layout.row#shelf-info","children":true,"blockRole":"children"}],"component":"vtex.product-summary@2.89.0\u002FProductSummaryCustom","composition":"children","hasContentSchema":true,"hydration":"always","implements":["vtex.product-summary@2.x:product-summary.shelf","vtex.product-summary@2.x:product-summary"],"preview":null,"props":{"blockClass":["shelf-search-modal"],"buyButtonText":"vtex.product-summary@2.x::store\u002Fbutton-label","labelSellingPrice":"vtex.product-summary@2.x::store\u002Fpricing.to","labelListPrice":"vtex.product-summary@2.x::store\u002Fpricing.from","sponsoredBadgeLabel":"vtex.product-summary@2.x::store\u002Fsponsored-badge.label","sponsoredBadgePosition":"titleTop","trackListName":true},"render":"server","track":[],"content":{"blockClass":["shelf-search-modal"],"buyButtonText":"vtex.product-summary@2.x::store\u002Fbutton-label","labelSellingPrice":"vtex.product-summary@2.x::store\u002Fpricing.to","labelListPrice":"vtex.product-summary@2.x::store\u002Fpricing.from","sponsoredBadgeLabel":"vtex.product-summary@2.x::store\u002Fsponsored-ba