erfeição, fazendo com que ambos os produtos tenham aderência a sua pele de uma forma natural, deixando a sua \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fmaquiagem\"\u003Emake\u003C\u002Fa\u003E deslumbrante."]},"__typename":"SpecificationGroupProperty"},"Product:sp-202316.specificationGroups.0.specifications.2":{"name":"Modelo","originalName":"Modelo","values":{"type":"json","json":["kit maquiagem océane esponja flat blend roxa base corretivo pó"]},"__typename":"SpecificationGroupProperty"},"Product:sp-202316.specificationGroups.0.specifications.3":{"name":"Característica principais PDP","originalName":"Característica principais PDP","values":{"type":"json","json":["O Kit Esponjas de Maquiagem Flat Blend Roxa Océane é perfeito para aplicar base, corretivo e pó. Expande de tamanho quando molhada, absorvendo menos produto e proporcionando acabamento natural e uniforme."]},"__typename":"SpecificationGroupProperty"},"Product:sp-202316.specificationGroups.0.specifications.4":{"name":"Como Usar","originalName":"Como Usar","values":{"type":"json","json":["\u003Ch2\u003EComo usar a Flat Blend?\u003C\u002Fh2\u003E\u003Cbr\u003EUsar a Flat Blend não tem segredo. Escolha o produto que quer usar e coloque sobre uma das superfícies da esponja, dando batidinhas leves sobre a pele. Para escolher qual lado da esponja usar, confira as dicas abaixo:\u003Cbr\u003E- Use o lado reto e inclinado da esponja para fazer uma make linda em áreas mais anguladas, como olhos e nariz.\u003Cbr\u003E- Se você tem manchas e pequenas imperfeições, ou quer fazer uma make em áreas menores do rosto, escolha a ponta menor para esta finalidade.\u003Cbr\u003E- A parte arredondada da esponja é ideal para fazer a cobertura em áreas maiores, como testa e bochechas.\u003Cbr\u003E\u003Cbr\u003E\u003Ch2\u003EComo lavar minha esponja de maquiagem?\u003C\u002Fh2\u003E\u003Cbr\u003E\u003Ca href=\"https:\u002F\u002Fblog.oceane.com.br\u002Fmaquiagem\u002Fcomo-lavar-esponja-de-maquiagem\u002F\"\u003ELavar sua esponja Flat Blend Roxa é fácil\u003C\u002Fa\u003E, basta seguir o passo a passo de limpeza para ter seu produto sempre pronto para uso:\u003Cbr\u003E- Molhe a esponja com água corrente até ficar bem encharcada;\u003Cbr\u003E- Passe um sabonete neutro sobre a esponja para soltar os resíduos grudados;\u003Cbr\u003E- Aperte delicadamente a esponja para fazer espuma;\u003Cbr\u003E- Enxágue com bastante água e coloque para secar à sombra.\u003Cbr\u003E\u003Cbr\u003EPronto! \u003Cb\u003ENão se esqueça de fazer essa rotina de limpeza regularmente\u003C\u002Fb\u003E para evitar o acúmulo de sujeiras na sua esponja, combinado?"]},"__typename":"SpecificationGroupProperty"},"Product:sp-202316.specificationGroups.0.specifications.5":{"name":"Cuidados","originalName":"Cuidados","values":{"type":"json","json":["Para maior durabilidade da sua Flat Blend, mantenha a sua esponja sempre limpa.\u003Cbr\u003E\u003Cbr\u003E\u003Cb\u003EComo limpar a sua esponja de maquiagem:\u003C\u002Fb\u003E Molhe a esponja e utilize sabonete neutro para lavar. Massageie para liberar a sujeira, mas sem friccionar. Enxágue em seguida até retirar todo o excesso de espuma. Deixe secar ao ar livre ou em lugar arejado. Não deixar de molho.\u003Cbr\u003E\u003Cbr\u003EMantenha fora do alcance de crianças."]},"__typename":"SpecificationGroupProperty"},"Product:sp-202316.specificationGroups.0.specifications.6":{"name":"Composição","originalName":"Composição","values":{"type":"json","json":["Espuma Hidrófila, sem Látex."]},"__typename":"SpecificationGroupProperty"},"Product:sp-202316.specificationGroups.1":{"name":"Indicação","originalName":"Indicação","specifications":[{"type":"id","generated":true,"id":"Product:sp-202316.specificationGroups.1.specifications.0","typename":"SpecificationGroupProperty"}],"__typename":"SpecificationGroup"},"Product:sp-202316.specificationGroups.1.specifications.0":{"name":"Parcerias","originalName":"Parcerias","values":{"type":"json","json":["Océane Purple"]},"__typename":"S