adaptam a cada ocasião.\u003Cbr\u003E\u003Cbr\u003ECom este produto, você não precisa de um \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fnecessaire\"\u003Enécessaire\u003C\u002Fa\u003E enorme, cheio de diferentes itens para criar um visual impactante sempre que precisar. Dividida em dois tipos de acabamento, a Face Palette vai proporcionar uma diversidade enorme de alternativas para a sua make. Vem conferir tudo com a gente:\u003Cbr\u003E\u003Cbr\u003E\u003Cb\u003ETonalidades matte:\u003C\u002Fb\u003E\u003Cbr\u003E- \u003Cb\u003ECool Peach\u003C\u002Fb\u003E é um blush coral lindíssimo, que confere um visual mais quente;\u003Cbr\u003E- \u003Cb\u003EFresh\u003C\u002Fb\u003E também funciona como blush, com uma pegada mais delicada na cor rosa clara;\u003Cbr\u003E- \u003Cb\u003ELite\u003C\u002Fb\u003E é recomendado para fazer contornos e deixar o rosto mais definido;\u003Cbr\u003E- \u003Cb\u003EBitten\u003C\u002Fb\u003E é super versátil e pode ser usado tanto como contorno quanto bronzer.\u003Cbr\u003E\u003Cbr\u003E\u003Cb\u003ETons Cintilantes:\u003C\u002Fb\u003E\u003Cbr\u003E- \u003Cb\u003EGleam\u003C\u002Fb\u003E é um iluminador dourado que realça sua sofisticação;\u003Cbr\u003E- \u003Cb\u003EPink Dune\u003C\u002Fb\u003E também pode ser utilizado como iluminador, mas sua luminosidade é mais delicada com sua coloração rosada;\u003Cbr\u003E- \u003Cb\u003EGolden Copper\u003C\u002Fb\u003E tem um acabamento acetinado incrível para ser usado como bronzer;\u003Cbr\u003E- \u003Cb\u003EBrick Berry\u003C\u002Fb\u003E promove um look impactante e moderno com sua colocação rosa magenta ao ser utilizado como blush.\u003Cbr\u003E\u003Cbr\u003EEla ainda conta com os atributos da \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Foceane-edition\"\u003Elinha Edition\u003C\u002Fa\u003E que a gente ama, como pigmentação maravilhosa e aquela durabilidade que faz você se sentir confortável para ter um dia inteiro de make intacta, proporcionando uma fixação prolongada com cor intensa desde a primeira passada."]},"__typename":"SpecificationGroupProperty"},"Product:sp-142312.specificationGroups.2.specifications.2":{"name":"Modelo","originalName":"Modelo","values":{"type":"json","json":["océane paleta multifuncional face palette bronzer blush contorno sombra"]},"__typename":"SpecificationGroupProperty"},"Product:sp-142312.specificationGroups.2.specifications.3":{"name":"Característica principais PDP","originalName":"Característica principais PDP","values":{"type":"json","json":["A Paleta Multifuncional Face Palette Océane Edition conta com iluminador, contorno, bronzer e blush. São 4 tons cintilantes e 4 tons matte, todos com alta pigmentação e fixação. Perfeita para levar no nécessaire e criar diferentes makes."]},"__typename":"SpecificationGroupProperty"},"Product:sp-142312.specificationGroups.2.specifications.4":{"name":"Como Usar","originalName":"Como Usar","values":{"type":"json","json":["\u003Ch2\u003EComo posso usar os tons matte?\u003C\u002Fh2\u003E\u003Cbr\u003EEles são super versáteis e podem ser utilizados como blush, contorno, sombra ou bronzer, tornando mais prática e dinâmica a sua rotina de beleza. Cada um deles pode ser utilizado sozinho ou por baixo de outros produtos, para dar base para uma make mais elaborada, criando um resultado surpreendente para a sua produção.\u003Cbr\u003E\u003Cbr\u003E\u003Ch2\u003EComo posso usar os tons cintilantes?\u003C\u002Fh2\u003E\u003Cbr\u003EIdeais para deixar a sua make mais iluminada e vibrante, eles podem ser utilizados como iluminador, bronzer ou blush, conferindo versatilidade na composição do seu look. Uma variedade incrível de cores para os mais diferentes tipos de make, tornando qualquer ocasião um grande acontecimento! \u003Cbr\u003E\u003Cbr\u003E\u003Ch2\u003EComo devo usar os itens da paleta?\u003C\u002Fh2\u003E\u003Cbr\u003EAposte nos pincéis Océane para cada tipo de produto. Para contornar o rosto,  \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fpincel-de-maquiagem-angulado---soft-angled-brush-ocn2-ap2000758cuni\u002Fp\"\u003EOCN2\u003C\u002Fa\u003E ou \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fpincel-chanfrado-para-blush-pink-my-apple-n11-ap2000041cuni\u002Fp\"\u003EOCN5\u003C\u002Fa\u003E são as melhores alternativas. \u003Cbr\u003E\u003Cbr\u003EJá para passar o blush, os pincéis \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fpincel-para-blush-blush-brush-ap2000316cuni\u002Fp\"\u003EOCN3\u003C\u002Fa\u003E ou \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fpincel-chanfrado-para-blush-pink-my-apple-n11-ap2000041cuni\u002Fp\"\u003EOCN5\u003C\u002Fa\u003E dão um resultado incrível.\u003Cbr\u003E\u003Cbr\u003EPor fim, para dar luminosidade, você pode utilizar o pincel \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fpincel-de-maquiagem-para-iluminador---shimmer-brush-ocn6-ap2000759cuni\u002Fp\"\u003EOCN6\u003C\u002Fa\u003E \tque não tem erro!"]},"__typename":"SpecificationGroupProperty"},"Product:sp-142312.specificationGroups.2.specifications.5":{"name":"Cuidados","originalName":"Cuidados","values":{"type":"json","json":["Em caso de irritabilidade suspenda o uso e procure auxílio médico. Manter o produto fechado em temperatura ambiente. Uso externo. Mantenha fora do alcance de crianças."]},"__typename":"SpecificationGroupProperty"},"Product:sp-142312.specificationGroups.2.specifications.6":{"name":"Composição","originalName":"Composição","values":{"type":"json","json":["Mica (Mica), Talc (Talco), Aluminum Starch Octenylsuccinate (Octenilsuccinato De Amido Alumínio), Silica (Dióxido De Silício), Dicalcium Phosphate (Fosfato De Cálcio Dibásico), Bentonite (Bentonita), Kaolin (Caulim), Zinc Palmitate (Palmitato De Zinco), Zinc Stearate (Estearato De Zinco), Boron Nitride (Nitreto De Boro), Triethoxycaprylylsilane (Trietoxicaprililsilano), Synthetic Fluorphlogopite (Fluorflogopita Sintética), Ethylhexyl Palmitate (Palmitato De Etilexila), Bis-Diglyceryl Polyacyladipate-2 (Poliaciladipato-2 De 