ilidade","__typename":"ProductClusters"},"Product:sp-142312.productClusters.1":{"id":"189","name":"Todos os produtos","__typename":"ProductClusters"},"Product:sp-142312.productClusters.2":{"id":"246","name":"Full","__typename":"ProductClusters"},"Product:sp-142312.productClusters.3":{"id":"276","name":"Lançamento","__typename":"ProductClusters"},"Product:sp-142312.productClusters.4":{"id":"760","name":"Océane Edition","__typename":"ProductClusters"},"Product:sp-142312.productClusters.5":{"id":"761","name":"Océane Edition - Paleta de Sombras","__typename":"ProductClusters"},"Product:sp-142312.productClusters.6":{"id":"971","name":"Face Palette Edition","__typename":"ProductClusters"},"Product:sp-142312.productClusters.7":{"id":"1003","name":"Vitrine Home | Lançamentos","__typename":"ProductClusters"},"Product:sp-142312.productClusters.8":{"id":"1007","name":"Queridinhos Com Até 20% OFF","__typename":"ProductClusters"},"Product:sp-142312.productClusters.9":{"id":"1008","name":"Dia dos Namorados I Ganhe 15%OFF EXTRA na compra de 3 ou + produtos","__typename":"ProductClusters"},"Product:sp-142312.clusterHighlights.0":{"id":"276","name":"Lançamento","__typename":"ClusterHighlight"},"Product:sp-142312.properties.0":{"name":"Texto Curto PDP","values":{"type":"json","json":["A Paleta Multifuncional Face Palette Océane Edition conta com iluminador, contorno, bronzer e blush. São 4 tons cintilantes e 4 tons matte. Confira!"]},"__typename":"Property"},"Product:sp-142312.properties.1":{"name":"Sobre","values":{"type":"json","json":["Versatilidade é uma palavra que define muito bem a nossa \u003Cb\u003EFace Palette Océane Edition\u003C\u002Fb\u003E. Isso porque ela te ajuda a compor uma \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fmaquiagem\"\u003Emaquiagem\u003C\u002Fa\u003E completa com muita praticidade, em um único produto. Esta \u003Cb\u003Epaleta multifuncional\u003C\u002Fb\u003E oferece várias possibilidades para a sua make, seja para o dia a dia ou para um evento em que você quer arrasar. Ela tem cores lindíssimas e sofisticadas que se adaptam a cada ocasião.\u003Cbr\u003E\u003Cbr\u003ECom este produto, você não precisa de um \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fnecessaire\"\u003Enécessaire\u003C\u002Fa\u003E enorme, cheio de diferentes itens para criar um visual impactante sempre que precisar. Dividida em dois tipos de acabamento, a Face Palette vai proporcionar uma diversidade enorme de alternativas para a sua make. Vem conferir tudo com a gente:\u003Cbr\u003E\u003Cbr\u003E\u003Cb\u003ETonalidades matte:\u003C\u002Fb\u003E\u003Cbr\u003E- \u003Cb\u003ECool Peach\u003C\u002Fb\u003E é um blush coral lindíssimo, que confere um visual mais quente;\u003Cbr\u003E- \u003Cb\u003EFresh\u003C\u002Fb\u003E também funciona como blush, com uma pegada mais delicada na cor rosa clara;\u003Cbr\u003E- \u003Cb\u003ELite\u003C\u002Fb\u003E é recomendado para fazer contornos e deixar o rosto mais definido;\u003Cbr\u003E- \u003Cb\u003EBitten\u003C\u002Fb\u003E é super versátil e pode ser usado tanto como contorno quanto bronzer.\u003Cbr\u003E\u003Cbr\u003E\u003Cb\u003ETons Cintilantes:\u003C\u002Fb\u003E\u003Cbr\u003E- \u003Cb\u003EGleam\u003C\u002Fb\u003E é um iluminador dourado que realça sua sofisticação;\u003Cbr\u003E- \u003Cb\u003EPink Dune\u003C\u002Fb\u003E também pode ser utilizado como iluminador, mas sua luminosidade é mais delicada com sua coloração rosada;\u003Cbr\u003E- \u003Cb\u003EGolden Copper\u003C\u002Fb\u003E tem um acabamento acetinado incrível para ser usado como bronzer;\u003Cbr\u003E- \u003Cb\u003EBrick Berry\u003C\u002Fb\u003E promove um look impactante e moderno com sua colocação rosa magenta ao ser utilizado como blush.\u003Cbr\u003E\u003Cbr\u003EEla ainda conta com os atributos da \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Foceane-edition\"\u003Elinha Edition\u003C\u002Fa\u003E que a gente ama, como pigmentação maravilhosa e aquela durabilidade que faz você se sentir confortável para ter um dia inteiro de make intacta, proporcionando uma fixação prolongada com cor intensa desde a primeira passada."]},"__typename":"Property"},"Product:sp-142312.properties.2":{"name":"Modelo","values":{"type":"json","json":["océane paleta multifuncional face palette bronzer blush contorno sombra"]},"__typename":"Property"},"Product:sp-142312.properties.3":{"name":"Característica principais PDP","values":{"type":"json","json":["A Paleta Multifuncional Face Palette Océane Edition conta com iluminador, contorno, bronzer e blush. São 4 tons cintilantes e 4 tons matte, todos com alta pigmentação e fixação. Perfeita para levar no nécessaire e criar diferentes makes."]},"__typename":"Property"},"Product:sp-142312.properties.4":{"name":"Como Usar","values":{"type":"json","json":["\u003Ch2\u003EComo posso usar os tons matte?\u003C\u002Fh2\u003E\u003Cbr\u003EEles são super versáteis e podem ser utilizados como blush, contorno, sombra ou bronzer, tornando mais prática e dinâmica a sua rotina de beleza. Cada um deles pode ser utilizado sozinho ou por baixo de outros produtos, para dar base para uma make mais elaborada, criando um resultado surpreendente para a sua produção.\u003Cbr\u003E\u003Cbr\u003E\u003Ch2\u003EComo posso usar os tons cintilantes?\u003C\u002Fh2\u003E\u003Cbr\u003EIdeais para deixar a sua make mais iluminada e vibrante, eles podem ser utilizados como iluminador, bronzer ou blush, conferindo versatilidade na composição do seu look. Uma variedade incrível de cores para os mais diferentes tipos de make, tornando qualquer ocasião um grande acontecimento! \u003Cbr\u003E\u003Cbr\u003E\u003Ch2\u003EComo devo usar os itens da paleta?\u003C\u002Fh2\u003E\u003Cbr\u003EAposte nos pincéis Océane para cada tipo de produto. Para contornar o rosto,  \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fpincel-de-maquiagem-angulado---soft-angled-brush-ocn2-ap2000758cuni\u002Fp\"\u003EOCN2\u003C\u002Fa\u003E ou \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fpincel-chanfrado-para-blush-pink-my-apple-n11-ap2000041cuni\u002Fp\"\u003EOCN5\u003C\u002Fa\u003E são as melhores alternativas. \u003Cbr\u003E\u003Cbr\u003EJá para passar o blush, os pincéis \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fpincel-para-blush-blush-brush-ap2000316cuni\u002Fp\"\u003EOCN3\u003C\u002Fa\u003E ou \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fpincel-chanfrado-para-blush-pink-my-apple-n11-ap2000041cuni\u002Fp\"\u003EOCN5\u003C\u002Fa\u003E dão um resultado incrível.\u003Cbr\u003E\u003Cbr\u003EPor fim, para dar luminosidade, você pode utilizar o pincel \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fpincel-de-maquiagem-para-iluminador---shimmer-brush-ocn6-ap2000759cuni\u002Fp\"\u003EOCN6\u003C\u002Fa\u003E \tque não tem erro!"]},"__typename":"Property"},"Product:sp-142312.properties.5":{"name":"Cuidados","values":{"type":"json","json":["Em caso de irritabilidade suspenda o uso e procure auxílio médico. Manter o produto fechado em temperatura ambiente. Uso externo. Mantenha fora do alcance de crianças."]},"__typename":"Property"},"Product:sp-142312.properties.6":{"name":"Composição","values":{"type":"json","json":["Mica (Mica), Talc (Talco), Aluminum Starch Octenylsuccinate (Octenilsuccinato De Amido Alumínio), Silica (Dióxido De Silício), Dicalcium Phosphate (Fosfato De Cálcio Dibásico), Bentonite (Bentonita), Kaolin (Caulim), Zinc Palmitate (Palmitato De Zinco), Zinc Stearate (Estearato De Zinco), Boron Nitride (Nitreto De Boro), Triethoxycaprylylsilane (Trietoxicaprililsilano), Synthetic Fluorphlogopite (Fluorflogopita Sintética), Ethylhexyl Palmitate (Palmitato De Etilexila), Bis-Diglyceryl Polyacyladipate-2 (Poliaciladipato-2 De Bis-Diglicerila), Tridecyl Trimellitate (Trimelitato De Tridecila), Dimethicone (Dimeticona), Magnesium Stearate (Estearato De Magnésio), Polyisobutene (Poli-Isobutileno), Phenoxyethanol (Fenoxietanol), Tocopheryl Acetate (Acetato De Tocoferila), Tin Oxide (Óxido De Estanho), Ethylhexylglyceri