. Recomendado para contornos e blushes líquidos, cremosos ou em pó;\u003Cbr\u003E\u003Cb\u003EOCN5\u003C\u002Fb\u003E - é aquele chanfrado tão amado que dá um acabamento incrível para blushes cremosos ou em pó;\u003Cbr\u003E\u003Cb\u003EOCN6\u003C\u002Fb\u003E - use-o para o pó facial ou iluminador, pois ele"]},"__typename":"SpecificationGroupProperty"},"Product:sp-142160.specificationGroups.2.specifications.2":{"name":"Modelo","originalName":"Modelo","values":{"type":"json","json":["kit mini pinceis océane base corretivopó blush"]},"__typename":"SpecificationGroupProperty"},"Product:sp-142160.specificationGroups.2.specifications.3":{"name":"Característica principais PDP","originalName":"Característica principais PDP","values":{"type":"json","json":["O Mini Kit com 5 Pincéis Océane é perfeito para caber no seu nécessaire de maquiagem e te acompanhar em todos os momentos, com esses minis pincéis você garante os acessórios necessários para se maquiar em qualquer lugar."]},"__typename":"SpecificationGroupProperty"},"Product:sp-142160.specificationGroups.2.specifications.4":{"name":"Como Usar","originalName":"Como Usar","values":{"type":"json","json":["\u003Ch2\u003EComo usar o Mini Kit com 5 Pincéis Océane?\u003C\u002Fh2\u003E\u003Cbr\u003E\u003Cbr\u003E\u003Ch2\u003EComo usar cada um dos pincéis?\u003C\u002Fh2\u003E\u003Cbr\u003ESe você quer saber como usar corretamente os pincéis do seu Mini Brush Kit, aqui vai:\u003Cbr\u003E\u003Cb\u003EOCN1\u003C\u002Fb\u003E - coloque um pouco de produto no dorso da mão e pegue com o pincel, aplicando diretamente no rosto;\u003Cbr\u003E\u003Cb\u003EOCN2\u003C\u002Fb\u003E - pegue o blush ou contorno diretamente com o pincel e tire o excesso do produto com batidinhas. Esfume com movimentos leves até obter o resultado desejado;\u003Cbr\u003E\u003Cb\u003EOCN5\u003C\u002Fb\u003E - com o próprio pincel, pegue o blush desejado e aplique nas maçãs do rosto em movimentos circulares. Esfume em direção ao couro cabeludo;\u003Cbr\u003E\u003Cb\u003EOCN6\u003C\u002Fb\u003E - pegue o iluminador ou pó com o pincel e aplique diretamente nas áreas desejadas, esfumando até alcançar o resultado que deseja;\u003Cbr\u003E\u003Cb\u003EOCN7\u003C\u002Fb\u003E - pegue um pouco da sombra escolhida com o pincel e retire o excesso. Então, deposite na região dos olhos com movimentos de vai-e-vem ou leves batidinhas."]},"__typename":"SpecificationGroupProperty"},"Product:sp-142160.specificationGroups.2.specifications.5":{"name":"Cuidados","originalName":"Cuidados","values":{"type":"json","json":["\u003Ch2\u003EComo higienizar corretamente os meus pincéis?\u003C\u002Fh2\u003E\u003Cbr\u003EÉ preciso saber \u003Ca href=”https:\u002F\u002Fblog.oceane.com.br\u002Fcomo-lavar-pincel-de-maquiagem\u002F”\u003Ecomo lavar os seus pincéis de maquiagem\u003C\u002Fa\u003E para que eles não causem nenhum tipo de alergia ou irritação na pele, além de prolongar a vida útil do seu acessório. Então, vamos lá: primeiro molhe o seu pincel com água fria e faça espuma nas cerdas com um shampoo, sabão ou sabonete neutro. Depois disso, enxágue bastante e com muito cuidado. Deixe secar em uma superfície seca com as cerdas viradas para baixo. Não tem segredo!"]},"__typename":"SpecificationGroupProperty"},"Product:sp-142160.specificationGroups.2.specifications.6":{"name":"Composição","originalName":"Composição","values":{"type":"json","json":["Cerdas De Fibra Sintética, Alumínio E Madeira. Item Não Perecível."]},"__typename":"SpecificationGroupProperty"},"Product:sp-142160.specificationGroups.2.specifications.7":{"name":"Selos","originalName":"Selos","values":{"type":"json","json":["Cruelty Free","Vegano"]},"__typename":"SpecificationGroupProperty"},"Product:sp-142160.specificationGroups.2.specifications.8":{"name":"PROMOCAO","originalName":"PROMOCAO","values":{"type":"json","json":["Sim"]},"__typename":"SpecificationGroupProperty"},"Product:sp-142160.specificationGroups.2.specifications.9":{"name":"sellerId","originalName":"sellerId","values":{"t