presente para quem ama uma boa make!\u003Cbr\u003E\u003Cbr\u003E\u003Ch2\u003EPor que o Capri Lipstick também hidrata os lábios?\u003C\u002Fh2\u003E\u003Cbr\u003EPor ter em sua formulação dois ativos importantes para a saúde dos seus lábios, como o \u003Cb\u003Eácido hialurônico e a vitamina E\u003C\u002Fb\u003E. O primeiro é um ativo super hidratante, que vai evitar o ressecamento da região da boca, além de auxiliar na espalhabilidade do produto. E o segundo é um ótimo antioxidante, que combate o envelhecimento precoce."]},"__typename":"SpecificationGroupProperty"},"Product:sp-162310.specificationGroups.3.specifications.2":{"name":"Modelo","originalName":"Modelo","values":{"type":"json","json":["océane capri maquiagem batom lipstick vinho"]},"__typename":"SpecificationGroupProperty"},"Product:sp-162310.specificationGroups.3.specifications.3":{"name":"Característica principais PDP","originalName":"Característica principais PDP","values":{"type":"json","json":["O Batom Capri Lipstick Godness possui o tom de vinho perfeito, acabamento semi-matte e fica super confortável nos lábios. Sua fórmula vegana e cruelty free possui Ácido Hialurônico e a Vitamina E."]},"__typename":"SpecificationGroupProperty"},"Product:sp-162310.specificationGroups.3.specifications.4":{"name":"Como Usar","originalName":"Como Usar","values":{"type":"json","json":["\u003Ch2\u003EQuando usar o meu batom na cor Godness?\u003C\u002Fh2\u003E\u003Cbr\u003ESempre que você quiser se sentir no poder e deixar a sua marca por onde passar. Ele dá cor e destaca o visual, trazendo aquele ar de sofisticação que não passa despercebido. A  tonalidade de vinho mais fechada comunica elegância e autoconfiança, podendo ser usada tanto no trabalho, ou em festas - você quem escolhe!\u003Cbr\u003E\u003Cbr\u003E\u003Ch2\u003EComo usar o batom?\u003C\u002Fh2\u003E\u003Cbr\u003EAplique o batom diretamente sobre os lábios, começando pelo centro, em direção às extremidades. Você ainda pode utilizar um espelho para te ajudar na aplicação. \u003Cbr\u003EPara um resultado mais intenso de cor, é possível construir camadas. Se você quiser lábios coloridos por mais tempo, foque na hidratação da região, com a ajuda do \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fhidratante-labial-com-vitamina-c-lip-balm-ap2000845co048f\u002Fp\"\u003ELip Balm com Vitamina C\u003C\u002Fa\u003E."]},"__typename":"SpecificationGroupProperty"},"Product:sp-162310.specificationGroups.3.specifications.5":{"name":"Cuidados","originalName":"Cuidados","values":{"type":"json","json":["Em caso de irritabilidade, suspenda o uso e procure seu médico de confiança. Mantenha sempre o produto fora do alcance de crianças e armazenado em um ambiente seco e arejado para melhor conservação. Uso externo."]},"__typename":"SpecificationGroupProperty"},"Product:sp-162310.specificationGroups.3.specifications.6":{"name":"Composição","originalName":"Composição","values":{"type":"json","json":["Octyldodecanol (Octildodecanol), Isononyl Isononanoate (Isononanoato De Isononila), Phenyl Trimethicone (Fenil Trimeticona), Ethylhexyl Palmitate (Palmitato De Etilexila), Silica (Sílica), Microcrystalline Wax (Cera Microcristalina), Ci 15850 (Corante Vermelho 15850), Synthetic Wax (Parafina), Vinyl Dimethicone\u002FMethicone Silsesquioxane Crosspolymer (Crospolímero De Vinil Dimeticona\u002FMeticona Silsesquioxano), Paraffin (Parafina), Ci 77499 (Corante Preto 77499), Ci 77491 (Corante Vermelho 77491), Copernicia Cerifera Cera (Cera De Carnaúba), Glyceryl Caprylate (Caprilato De Glicerila), Ricinus Communis (Castor) Seed Oil (Óleo Da Semente De Mamona), Sodium Hyaluronate (Hialuronato De Sódio), Hydrogenated Castor Oil (Óleo De Rícino Hidrogenado), Limnanthes Alba (Meadowfoam) Seed Oil (Óleo De Semente De Espuma-Do-Prado), Tocopheryl Acetate (Acetato De Tocoferila), Ci 42090 (Corante Azul Brilhante 42090), Triethoxycaprylylsilane (Trietoxicaprililsilano), Parfum (Perfume), Bht (Butil-Hidroxitolueno)."]},"__typename":"SpecificationGroupPr