u002F\u002Fblog.oceane.com.br\u002Fmaquiagem\u002Foceane-edition\u002F\"\u003Elinha Océane Edition\u003C\u002Fa\u003E que vai ganhar o seu coração.\u003Cbr\u003E\u003Cbr\u003EEsse pó compacto HD ultrafino e sem cor pode ser usado por pessoas com diversos tons de pele. Ele possui textura incrível que \u003Cb\u003Esela a maquiagem sem pesar\u003C\u002Fb\u003E e proporciona uma sensação agradável após o uso. Ah, claro, ele \u003Cb\u003Ematifica e controla a oleosidade\u003C\u002Fb\u003E do seu rosto.\u003Cbr\u003E\u003Cbr\u003EO Retouch My Glam permite criar uma \u003Ca href=\"https:\u002F\u002Fblog.oceane.com.br\u002Fmaquiagem\u002Fmaquiagem-blindada-como-fazer-uma-make-que-dura-muito\u002F\"\u003Emaquiagem blindada que dura muito tempo\u003C\u002Fa\u003E e vai transformar a sua produção. Tudo isso graças ao efeito Blur, que \u003Cb\u003Edisfarça imperfeições, linhas finas e os poros dilatados\u003C\u002Fb\u003E na pele. Sem falar do acabamento delicado e sedoso, finalizando a make do jeito que você sempre quis.\u003Cbr\u003E\u003Cbr\u003ESua \u003Cb\u003Efórmula vegana\u003C\u002Fb\u003E foi desenvolvida com alta tecnologia para contemplar a beleza de todos os tipos de pele, seja de dia ou à noite. Ideal para ser usado na make do trabalho, no look da viagem e até mesmo para uma \u003Ci\u003Enight\u003C\u002Fi\u003E de diversão com amigos. Por proporcionar um efeito natural e suave, ele é indicado para qualquer momento.\u003Cbr\u003E\u003Cbr\u003ENa hora de montar o seu \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fmaquiagem\u002Fkits-de-maquiagem\"\u003Ekit de maquiagem\u003C\u002Fa\u003E, não deixe o Retouch My Glam da Océane de fora. Com certeza, ele vai ser o seu melhor amigo em todas as horas.\u003Cbr\u003E \u003Cbr\u003E\u003Ch2\u003EQuem pode usar o Retouch My Glam?\u003C\u002Fh2\u003E\u003Cbr\u003EQualquer pessoa que deseja uma maquiagem bem finalizada e com acabamento incrível pode usar este produto. Seja sua pele normal, oleosa ou seca, todo mundo sai ganhando com o Retouch My Glam, pois ele não pesa na pele, não deixa o rosto gorduroso, não resseca e também controla a oleosidade excessiva. Então, você também pode aplicá-lo sem medo!"]},"__typename":"SpecificationGroupProperty"},"Product:sp-81888.specificationGroups.2.specifications.2":{"name":"Modelo","originalName":"Modelo","values":{"type":"json","json":["Pó Compacto Retouch My Glam Océane Edition Pó Compacto"]},"__typename":"SpecificationGroupProperty"},"Product:sp-81888.specificationGroups.2.specifications.3":{"name":"Característica principais PDP","originalName":"Característica principais PDP","values":{"type":"json","json":["O Pó Compacto Retouch My Glam Océane Edition é perfeito para levar na bolsa e retocar a sua maquiagem a qualquer momento, esse pó ultrafino matifica e controla a oleosidade do seu rosto. Fórmula vegana e cruelty free."]},"__typename":"SpecificationGroupProperty"},"Product:sp-81888.specificationGroups.2.specifications.4":{"name":"Como Usar","originalName":"Como Usar","values":{"type":"json","json":["\u003Ch2\u003EO que usar para aplicar o Retouch My Glam em meu rosto?\u003C\u002Fh2\u003E\u003Cbr\u003EOcéane tem uma quantidade grande de \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fmaquiagem\u002Fpinceis\"\u003EPincéis\u003C\u002Fa\u003E que fazem toda a diferença, mas para o Retouch My Glam, recomendamos o \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fpincel-de-maquiagem-para-po-tiny-must-brush-n10-ap2000042cuni\u002Fp\"\u003EPincel para Pó Ocn4\u003C\u002Fa\u003E. Ele é um acessório macio e volumoso que espalha o pó facial de maneira uniforme, proporcionando uma cobertura fina e um esfumado sem marcas.\u003Cbr\u003E\u003Cbr\u003EE se você é fã de esponjas, experimente a Esponja \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fmini-esponja-para-acabamento-rosa-mini-powder-puff-oceane-edition-ap2001155c0306\u002Fp\"\u003EMini Powder Puff\u003C\u002Fa\u003E da Linha Edition, que permite criar uma make homogênea e bem finalizada. Ela é feita com material super macio e seu formato facilita a aplicação até nos cantinhos mais difíceis de alcançar.\u003Cbr\u003E \u003Cbr\u003E\u003Ch2\u003EComo usar o Retouch My Glam?\u003C\u002Fh2\u003E\u003Cbr\u003EVocê pode aplicar o Retouch My Glam de duas formas:\u003Cbr\u003E\u003Cbr\u003E\u003Cb\u003ECom a Esponja Mini Powder Puff:\u003C\u002Fb\u003E passe a esponja no pó compacto e aplique na pele, dando leves batidinhas. Alcance todos os cantos do rosto utilizando os diferentes lados do acessório.\u003Cbr\u003E\u003Cbr\u003E\u003Cb\u003ECom o Pincel para Pó Ocn4:\u003C\u002Fb\u003E basta passar o seu pincel diretamente no cosmético e espalhar pelo rosto com movimentos circulares. Esfume as áreas aplicadas para não deixar marcas de pó compacto.\u003Cbr\u003EIndependentemente do tipo de aplicador que você escolher na hora de aplicar este pó facial, é sempre bom retirar o excesso de produto acumulado no rosto. Para isso, utilize o \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fpincel-leque-para-maquiagem-gleam-my-face-ba15-ap2000375cuni\u002Fp\"\u003EPincel Leque Ocn18\u003C\u002Fa\u003E em suaves movimentos ascendentes pela sua pele."]},"__typename":"SpecificationGroupProperty"},"Product:sp-81888.specificationGroups.2.specifications.5":{"name":"Cuidados","originalName":"Cuidados","values":{"type":"json","json":["Em caso de irritabilidade suspenda o uso e procure auxílio médico. Manter o produto fechado em temperatura ambiente. Uso externo. Mantenha fora do alcance de crianças."]},"__typename":"SpecificationGroupProperty"},"Product:sp-81888.specificationGroups.2.specifications.6":{"name":"Composição","originalName":"Composição","values":{"type":"json","json":["Talc (Talco), Mica (Mica), Polymethylsilsesquioxane (Polimetilsilsesquioxano), Dimethicone (Dimeticona), Octyldodecyl Stearoyl Stearate (Estearo De Octildodecil Estearoil), Magnesium Stearate Phenoxyethanol (Fenoxietanol De Estearato De Magnésio), Caprylyl Glycol (Capri