duct:sp-142041.specificationGroups.0.specifications.0":{"name":"Texto Curto PDP","originalName":"Texto Curto PDP","values":{"type":"json","json":["O Contorno em Bastão Edition Light é macio e fácil de esfumar. Com alta pigmentação e fixação, com cera de candelila e óleo de semente de jojoba."]},"__typename":"SpecificationGroupProperty"},"Product:sp-142041.specificationGroups.0.specifications.1":{"name":"Sobre","originalName":"Sobre","values":{"type":"json","json":["O produto definitivo para uma maquiagem profissional, que realça e define os traços do seu rosto com muita naturalidade. Sim, estamos falando dele: o contorno! O Contour Stick Edition faz parte da linha \u003Ca href=\"https:\u002F\u002Fblog.oceane.com.br\u002Fmaquiagem\u002Foceane-edition\u002F\"\u003E Océane Edition\u003C\u002Fa\u003E e promete trazer praticidade aliada a um resultado incrível para as suas produções.\u003Cbr\u003E\u003Cbr\u003ESeu \u003Cb\u003Eformato em bastão\u003C\u002Fb\u003E torna mais prático o processo de \u003Ca href=\"https:\u002F\u002Fblog.oceane.com.br\u002Fmaquiagem\u002Fcontorno-na-maquiagem\u002F\"\u003Efazer contorno na maquiagem\u003C\u002Fa\u003E de um jeito preciso e super confortável. A \u003Cb\u003Ecor Light\u003C\u002Fb\u003E é um marrom claro que combina com diversos tons de pele. E o melhor: a embalagem possui um detalhe na mesma tonalidade do contorno, possibilitando ver a sua cor sem abri-la.\u003Cbr\u003E\u003Cbr\u003ENão podemos deixar de mencionar que ele tem \u003Cb\u003Elonga duração\u003C\u002Fb\u003E, permitindo que o seu look dure muito tempo. Esse contorno facial é formulado com cera de candelila e óleo de semente de jojoba, o que faz com que ele se espalhe facilmente na pele. Além disso, ele tem \u003Cb\u003Ealta pigmentação\u003C\u002Fb\u003E e \u003Cb\u003Etextura cremosa que não escorre\u003C\u002Fb\u003E e não deixa a pele oleosa.\u003Cbr\u003E\u003Cbr\u003EPermita-se descobrir as maravilhas que este produto pode fazer pelo seu visual. Você nunca mais vai querer ficar sem este item no seu \u003Ca href=”https:\u002F\u002Fwww.oceane.com.br\u002Fnecessaire”\u003Enécessaire\u003C\u002Fa\u003E!\u003Cbr\u003E\u003Cbr\u003E\u003Ch2\u003EQual é o diferencial da maquiagem em bastão?\u003C\u002Fh2\u003E\u003Cbr\u003EA \u003Ca href=\"https:\u002F\u002Fblog.oceane.com.br\u002Fmaquiagem\u002Fmaquiagem-em-bastao-motivos-para-incluir-na-necessarie\u002F\"\u003Emaquiagem em bastão\u003C\u002Fa\u003E é sucesso no mundo das maquiagens e se você ainda não experimentou, está na hora de provar. Esse formato  \u003Cb\u003Efacilita a aplicação\u003C\u002Fb\u003E até mesmo para quem não tem muita experiência na hora de fazer contorno facial, além de ser muito prático para ser levado sempre na bolsa ou no estojo de maquiagem. Vem se apaixonar por ele também!\u003Cbr\u003E\u003Cbr\u003E\u003Ch2\u003EPor que fazer contorno facial? \u003C\u002Fh2\u003E\u003Cbr\u003EAlgumas pessoas gostam de dar mais definição ao rosto, realçando ou disfarçando"]},"__typename":"SpecificationGroupProperty"},"Product:sp-142041.specificationGroups.0.specifications.2":{"name":"Modelo","originalName":"Modelo","values":{"type":"json","json":["maquiagem contorno bastão edition océane"]},"__typename":"SpecificationGroupProperty"},"Product:sp-142041.specificationGroups.0.specifications.3":{"name":"Contorno","originalName":"Contorno","values":{"type":"json","json":["Bastão"]},"__typename":"SpecificationGroupProperty"},"Product:sp-142041.specificationGroups.0.specifications.4":{"name":"Característica principais PDP","originalName":"Característica principais PDP","values":{"type":"json","json":["O Contorno em Bastão Océane Edition Light veio para facilitar a sua maquiagem, sua fórmula é super macia e fácil de esfumar. Com alta pigmentação e fixação, esse contorno conta com cera de candelila e óleo de semente de jojoba."]},"__typename":"SpecificationGroupProperty"},"Product:sp-142041.specificationGroups.0.specifications.5":{"name":"Como Usar","originalName":"Como Usar","values":{"type":"json","json":["\u003Ch2\u003EComo usar o Contour Stick Edition? \u003C\u002Fh2\u003E\u003Cbr\u003E\u003Cbr\u003EO produto deve ser aplicado diretamente na pele: na ponta do queixo, nas laterais do nariz e abaixo das maçãs do rosto, traçando em direção das orelhas. Então, para um resultado incrível, esfume com os pincéis \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fpincel-para-maquiagem-cupcake-brush-ap2000322cuni\u002Fp\"\u003EOCN01\u003C\u002Fa\u003E ou \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fpincel-de-maquiagem-angulado---soft-angled-brush-ocn2-ap2000758cuni\u002Fp\"\u003EOCN02\u003C\u002Fa\u003E. Você pode usar também a \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fesponja-de-maquiagem-flat-drop-oceane-edition-ap2001056c001\u002Fp\"\u003EEsponja de Maquiagem Océane Edition\u003C\u002Fa\u003E. Nas áreas menores do rosto, você pode usar os pincéis \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fpincel-de-maquiagem-para-corretivo-light-me-up-n35-ap2000040cuni\u002Fp\"\u003EOCN07\u003C\u002Fa\u003E, \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fpincel-para-sombra-soft-smoke-brush-ap2000323cuni\u002Fp\"\u003EOCN08\u003C\u002Fa\u003E ou \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fpincel-de-maquiagem-para-detalhe-chanfrado---flat-angled-brush-ocn13-ap2000762cuni\u002Fp\"\u003EOCN13\u003C\u002Fa\u003E para atingir o resultado desejado.\u003Cbr\u003E\u003Cbr\u003EE para aquele efeito \"olhão\" super marcado, temos uma dica para você: use o contorno cremoso em bastão na pálpebra, como uma espécie de base para sombras escuras. Para isso, você pode usar um pincel para sombra para esfumar o contorno na área dos olhos.\u003Cbr\u003E"]},"__typename":"SpecificationGroupProperty"},"Product:sp-142041.specificationGroups.0.specifications.6":{"name":"Cuidados","originalName":"Cuidados","values":{"type":"json","json":["Dica: devido à sua fórmula mais emoliente, ao aplicar o Contorno em Bastão Marro