":"Característica principais PDP","values":{"type":"json","json":["O Contorno em Bastão Océane Edition Light veio para facilitar a sua maquiagem, sua fórmula é super macia e fácil de esfumar. Com alta pigmentação e fixação, esse contorno conta com cera de candelila e óleo de semente de jojoba."]},"__typename":"Property"},"Product:sp-142041.properties.5":{"name":"Como Usar","values":{"type":"json","json":["\u003Ch2\u003EComo usar o Contour Stick Edition? \u003C\u002Fh2\u003E\u003Cbr\u003E\u003Cbr\u003EO produto deve ser aplicado diretamente na pele: na ponta do queixo, nas laterais do nariz e abaixo das maçãs do rosto, traçando em direção das orelhas. Então, para um resultado incrível, esfume com os pincéis \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fpincel-para-maquiagem-cupcake-brush-ap2000322cuni\u002Fp\"\u003EOCN01\u003C\u002Fa\u003E ou \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fpincel-de-maquiagem-angulado---soft-angled-brush-ocn2-ap2000758cuni\u002Fp\"\u003EOCN02\u003C\u002Fa\u003E. Você pode usar também a \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fesponja-de-maquiagem-flat-drop-oceane-edition-ap2001056c001\u002Fp\"\u003EEsponja de Maquiagem Océane Edition\u003C\u002Fa\u003E. Nas áreas menores do rosto, você pode usar os pincéis \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fpincel-de-maquiagem-para-corretivo-light-me-up-n35-ap2000040cuni\u002Fp\"\u003EOCN07\u003C\u002Fa\u003E, \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fpincel-para-sombra-soft-smoke-brush-ap2000323cuni\u002Fp\"\u003EOCN08\u003C\u002Fa\u003E ou \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fpincel-de-maquiagem-para-detalhe-chanfrado---flat-angled-brush-ocn13-ap2000762cuni\u002Fp\"\u003EOCN13\u003C\u002Fa\u003E para atingir o resultado desejado.\u003Cbr\u003E\u003Cbr\u003EE para aquele efeito \"olhão\" super marcado, temos uma dica para você: use o contorno cremoso em bastão na pálpebra, como uma espécie de base para sombras escuras. Para isso, você pode usar um pincel para sombra para esfumar o contorno na área dos olhos.\u003Cbr\u003E"]},"__typename":"Property"},"Product:sp-142041.properties.6":{"name":"Cuidados","values":{"type":"json","json":["Dica: devido à sua fórmula mais emoliente, ao aplicar o Contorno em Bastão Marrom Claro Océane Edition, não é necessário girar muito a embalagem, dê apenas uma ou duas voltas para garantir uma aplicação confortável e sem risco de quebra do produto.\u003Cbr\u003EEm caso de irritabilidade, suspenda o uso e procure auxílio médico. Manter o produto em temperatura ambiente."]},"__typename":"Property"},"Product:sp-142041.properties.7":{"name":"Composição","values":{"type":"json","json":["C12-15 ALKYL BENZOATE (C12-15 ALQUIL BENZOATO), TRIETHYLHEXANOIN (TRIETILHEXANOÍNA), DIMETHICONE (DIMETICONA), SYNTHETIC FLUORPHLOGOPITE (FLUORFLOGOPITA SINTÉTICA), ZEA MAYS (CORN) STARCH (AMIDO), MICROCRYSTALLINE WAX (CERA MICROCRISTALINA), SYNTHETIC WAX (PARAFINA), CI 77492 (ÓXIDO DE FERRO AMARELO), CI 77491 (ÓXIDO DE FERRO VERMELHO), CI 77499 (ÓXIDO DE FERRO PRETO), PARAFFIN (PARAFINA), GLYCERYL CAPRYLATE (CAPRILATO DE GLICERILA), CI 77891 (DIÓXIDO DE TITÂNIO), EUPHORBIA CERIFERA (CANDELILLA) WAX (CERA DE EUPHORBIA CERIFERA (CANDELILA)), ARGANIA SPINOSA KERNEL OIL (ÓLEO DO GRÃO DE ARGANIA SPINOSA), SIMMONDSIA CHINENSIS (JOJOBA) SEED OIL (ÓLEO DE SEMENTE DE SIMMONDSIA CHINENSIS (JOJOBA)), TOCOPHERYL ACETATE (ACETATO DE DEXTROALFATOCOFEROL), PARFUM (FRAGRÂNCIA), ALUMINUM HYDROXIDE (HIDRÓXIDO DE ALUMÍNIO), TRIETHOXYCAPRYLYLSILANE (TRIETOXICAPRILILSILANO), BHT (BUTIL-HIDROXITOLUENO)."]},"__typename":"Property"},"Product:sp-142041.properties.8":{"name":"Selos","values":{"type":"json","json":["Cruelty Free","Vegano"]},"__typename":"Property"},"Product:sp-142041.properties.9":{"name":"Parcerias","values":{"type":"json","json":["Océane Edition"]},"__typename":"Property"},"Product:sp-142041.properties.10":{"name":"PROMOCAO","values":{"type":"json","json":["Não"]},"__typename