minador em um só produto, sua fórmula garante brilho intenso. Conta com embalagem compacta. Veja!"]},"__typename":"SpecificationGroupProperty"},"Product:sp-142098.specificationGroups.2.specifications.1":{"name":"Sobre","originalName":"Sobre","values":{"type":"json","json":["Para deixar a sua \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fmaquiagem\"\u003Emaquiagem\u003C\u002Fa\u003E vibrante, luminosa e com aquele brilho todo especial, aposte no uso de um iluminador que faz toda a diferença no seu look. O \u003Cb\u003EMulticolor Powder Edition\u003C\u002Fb\u003E apresenta \u003Cb\u003E4 cores de iluminadores\u003C\u002Fb\u003E em um único produto para você arrasar em todas as situações.\u003Cbr\u003E\u003Cbr\u003EIdeal para vários tons de pele, o produto varia da cor mais clara até um belíssimo dourado para combinar com o seu estilo. Todas elas possuem partículas luminosas que refletem a luz e fazem com que elas sejam capturadas pela luz ambiente, destacando o visual e fazendo você brilhar como nunca. \u003Cbr\u003E\u003Cbr\u003EO iluminador é uma \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fmaquiagem\u002Frosto\"\u003Emaquiagem para o rosto\u003C\u002Fa\u003E com um potencial incrível para dar um \u003Ci\u003Eglow\u003C\u002Fi\u003E espetacular na sua produção. Com uma \u003Cb\u003Etextura leve e confortável\u003C\u002Fb\u003E, sua fórmula garante brilho intenso desde a primeira aplicação. E sua durabilidade também vai te surpreender, viu?\u003Cbr\u003E\u003Cbr\u003ESua embalagem redonda possui um \u003Cb\u003Eespelho interno\u003C\u002Fb\u003E, ideal para retoques em qualquer lugar. Além disso, ela é pequena e cabe perfeitamente no seu \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fmaquiagem\u002Fnecessaire\"\u003Enécessaire\u003C\u002Fa\u003E. Seu sistema de travamento impede que o estojo seja aberto sem querer, o que te dá a segurança que você precisa para levar este produto sempre com você.\u003Cbr\u003E\u003Cbr\u003EAposte \u003Ca href=\"https:\u002F\u002Fblog.oceane.com.br\u002Fmaquiagem\u002Filuminador-maquiagem\u002F\"\u003Eno uso do iluminador na maquiagem\u003C\u002Fa\u003E! O Multicolor Powder Edition tem tudo para fazer se apaixonar.\u003Cbr\u003E\u003Cbr\u003E\u003Ch2\u003EQual o melhor iluminador: líquido, em pó ou cremoso?\u003C\u002Fh2\u003E\u003Cbr\u003ETodos os iluminadores têm as suas qualidades e deixam a sua \u003Cb\u003Eprodução do jeito que você ama\u003C\u002Fb\u003E. O líquido, por exemplo, se espalha com facilidade e tem uma fixação poderosa. Super indicado para peles maduras. O iluminador cremoso é indicado para acentuar pontos fortes do rosto e o iluminador em pó permite a construção do glow que a gente tanto deseja. Ele não derrete na maquia"]},"__typename":"SpecificationGroupProperty"},"Product:sp-142098.specificationGroups.2.specifications.2":{"name":"Modelo","originalName":"Modelo","values":{"type":"json","json":["maquiagem océane iluminador pó"]},"__typename":"SpecificationGroupProperty"},"Product:sp-142098.specificationGroups.2.specifications.3":{"name":"Característica principais PDP","originalName":"Característica principais PDP","values":{"type":"json","json":["O Iluminador Multicolor Powder possui 4 tons de iluminador em um só produto, sua fórmula garante brilho intenso. Conta com embalagem compacta e com espelho."]},"__typename":"SpecificationGroupProperty"},"Product:sp-142098.specificationGroups.2.specifications.4":{"name":"Como Usar","originalName":"Como Usar","values":{"type":"json","json":["\u003Ch2\u003EComo usar o meu Multicolor Powder Edition?\u003C\u002Fh2\u003E\u003Cbr\u003EUse um pincel para depositar e espalhar o produto nos pontos que você quer iluminar e destacar. Recomendamos o uso do pincel \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fpincel-de-maquiagem-angulado---soft-angled-brush-ocn2-ap2000758cuni\u002Fp\"\u003EOCN2\u003C\u002Fa\u003E e \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fpincel-de-maquiagem-para-iluminador---s