ouquinho da Mini Drop Océane Edition, está na hora de colocá-la no seu \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fmaquiagem\u002Fnecessaire\"\u003Enécessaire\u003C\u002Fa\u003E e fazer dela a sua aliada em todos os momentos. Você vai se apaixonar!\u003Cbr\u003E\u003Cbr\u003E\u003Ch2\u003EPor que a Mini Drop Océane Edition consegue um resultado diferenciado?\u003C\u002Fh2\u003E\u003Cbr\u003EAlém do formato que se adapta ao rosto todo, essa esponja é feita com um material que \u003Cb\u003Eimita os poros da pele\u003C\u002Fb\u003E. E o acabamento é você quem define: para uma cobertura intensa, use a esponja seca; para um resultado mais natural,"]},"__typename":"SpecificationGroupProperty"},"Product:sp-142311.specificationGroups.2.specifications.2":{"name":"Departamento","originalName":"Departamento","values":{"type":"json","json":["Feminino"]},"__typename":"SpecificationGroupProperty"},"Product:sp-142311.specificationGroups.2.specifications.3":{"name":"Modelo","originalName":"Modelo","values":{"type":"json","json":["esponja maquiagem mini drop océane edition base corretivo"]},"__typename":"SpecificationGroupProperty"},"Product:sp-142311.specificationGroups.2.specifications.4":{"name":"Característica principais PDP","originalName":"Característica principais PDP","values":{"type":"json","json":["A Esponja de Maquiagem Mini Drop Océane Edition é perfeita para alcançar os cantinhos mais difíceis do rosto. Expande de tamanho quando molhada, absorvendo menos produto e proporcionando acabamento natural e uniforme."]},"__typename":"SpecificationGroupProperty"},"Product:sp-142311.specificationGroups.2.specifications.5":{"name":"Como Usar","originalName":"Como Usar","values":{"type":"json","json":["\u003Ch2\u003EComo usar a minha esponja de maquiagem?\u003C\u002Fh2\u003E\u003Cbr\u003EUse a Mini Drop Océane Edition para aplicar \u003Cb\u003Ebase, corretivo ou pó\u003C\u002Fb\u003E, na textura de sua preferência. Basta pegar o produto de sua preferência com a esponja 