ma esponja de maquiagem pequena no tamanho e gigante no resultado. Compacta, ela é perfeita para levar no nécessaire e conseguir aquele look incrível onde quer que você esteja.\u003Cbr\u003E\u003Cbr\u003EO produto faz parte da linha Océane Edition e é uma versão miniatura da \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fesponja-para-maquiagem-special-diamond-blend-nude-ap2000458cr14\u002Fp\"\u003ESpecial Diamond Blend\u003C\u002Fa\u003E, ideal para aplicar \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fmaquiagem\u002Frosto\"\u003Emaquiagem para o rosto\u003C\u002Fa\u003E. Ela tem um \u003Cb\u003Edesign inovador\u003C\u002Fb\u003E que alcança todos os cantinhos. Com a ponta menor, você consegue fazer contorno facial e pegar áreas maiores, enquanto a ponta maior vai naqueles lugares de mais difícil acesso, como canto dos olhos e do nariz. Ainda conta com uma tira central que auxilia na aplicação dos produtos e evita que você suje suas mãos.\u003Cbr\u003E\u003Cbr\u003EAlém disso, ela apresenta resultados diferentes de acordo com a utilização: se usá-la seca, a cobertura se torna mais intensa por causa da quantidade de produto que ela deposita. Quando molhada, o produto se expande e o resultado é mais natural e suave, porque consome menos maquiagem.\u003Cbr\u003E\u003Cbr\u003EVale ressaltar que essa esponja \u003Cb\u003Enão contém látex\u003C\u002Fb\u003E, o que diminui as chances de causar  alergias e irritações cutâneas. Agora que você já conhece um pouquinho da Mini Drop Océane Edition, está na hora de colocá-la no seu \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fmaquiagem\u002Fnecessaire\"\u003Enécessaire\u003C\u002Fa\u003E e fazer dela a sua aliada em todos os momentos. Você vai se apaixonar!\u003Cbr\u003E\u003Cbr\u003E\u003Ch2\u003EPor que a Mini Drop Océane Edition consegue um resultado diferenciado?\u003C\u002Fh2\u003E\u003Cbr\u003EAlém do formato que se adapta ao rosto todo, essa esponja é feita com um material que \u003Cb\u003Eimita os poros da pele\u003C\u002Fb\u003E. E o acabamento é você quem define: para uma cobertura intensa, use a esponja seca; para um resultado mais natural,"]},"__typename":"Property"},"Product:sp-142311.properties.2":{"name":"Departamento","values":{"type":"json","json":["Feminino"]},"__typename":"Property"},"Product:sp-142311.properties.3":{"name":"Modelo","values":{"type":"json","json":["esponja maquiagem mini drop océane edition base corretivo"]},"__typename":"Property"},"Product:sp-142311.properties.4":{"name":"Característica principais PDP","values":{"type":"json","json":["A Esponja de Maquiagem Mini Drop Océane Edition é perfeita para alcançar os cantinhos mais difíceis do rosto. Expande de tamanho quando molhada, absorvendo menos produto e proporcionando acabamento natural e uniforme."]},"__typename":"Property"},"Product:sp-142311.properties.5":{"name":"Como Usar","values":{"type":"json","json":["\u003Ch2\u003EComo usar a minha esponja de maquiagem?\u003C\u002Fh2\u003E\u003Cbr\u003EUse a Mini Drop Océane Edition para aplicar \u003Cb\u003Ebase, corretivo ou pó\u003C\u002Fb\u003E, na textura de sua preferência. Basta pegar o produto de sua preferência com a esponja e aplicar com leves batidinhas na pele, até atingir o resultado desejado. Molhe a esponja para um acabamento mais suave ou use-a seca para uma cobertura com mais definição. A ponta menor pode ser usada para o contorno facial ou base, enquanto a maior é perfeita para aplicar o corretivo.\u003Cbr\u003E\u003Cbr\u003E\u003Ch2\u003EComo higienizar de forma certa a minha Mini Drop Océane Edition?\u003C\u002Fh2\u003E\u003Cbr\u003ESe você não sabe \u003Ca href=\"https:\u002F\u002Fblog.oceane.com.br\u002Fmaquiagem\u002Fcomo-lavar-esponja-de-maquiagem\u002F\"\u003Ecomo lavar a sua esponja de maquiagem\u003C\u002Fa\u003E, a gente ajuda você: use detergente neutro para remover o excesso de cosméticos que se acumulam no produto. Enxágue até que a água saia limpa. Não é recomendado deixá-la de molho."]},"__typename":"Property"},"Product:sp-142311.properties.6":{"name":"Cuidados","values":{"type":"json","json":["Para maior durabilidade da sua Mini Drop, mantenha a sua esponja sempre limpa.\u003Cbr\u003EMantenha fora do alcance de crianças."]},"__typename":"Property"},"Product:sp-142311.properties.7":{"name":"Composição","values":{"type":"json","json":["Espuma Hidrófila, sem Látex."]},"__typename":"Property"},"Product:sp-142311.properties.8":{"name":"Selos","values":{"type":"json","json":["Vegano","Cruelty Free"]},"__typename":"Property"},"Product:sp-142311.properties.9":{"name":"Parcerias","values":{"type":"json","json":["Océane Edition"]},"__typename":"Property"},"Product:sp-142311.properties.10":{"name":"PROMOCAO","values":{"type":"json","json":["Sim"]},"__typename":"Property"},"Product:sp-142311.properties.11":{"name":"sellerId","values":{"type":"json","json":["1"]},"__typename":"Property"},"Product:sp-142311.items({\"filter\":\"ALL_AVAILABLE\"}).0":{"itemId":"142387","name":"Mini Esponja de Maquiagem - Mini Drop Océane Edition","nameComplete":"Mini Esponja de Maquiagem - Mini Drop Océane Edition","complementName":"Mini Esponja de Maquiagem Mini Drop Océane Edition","ean":"7908725501099","variations":[{"type":"id","generated":true,"id":"Product:sp-142311.items({\"filter\":\"ALL_AVAILABLE\"}).0.variations.0","typename":"Property"}],"referenceId":[{"type":"id","generated":true,"id":"Product:sp-142311.items({\"filter\":\"ALL_AVAILABLE\"}).0.referenceId.0","typename":"Reference"}],"measurementUnit":"un","unitMultiplier":1,"images":[{"type":"id","generated":false,"id":"Image:206384","typename":"Image"},{"type":"id","generated":false,"id":"Image:206385","typename":"Image"},{"type":"id","generated":false,"id":"Image:206386","typename":"Image"},{"type":"id","generated":false,"id":"Image:206387","typename":"Image"},{"type":"id","generated":false,"id":"Image:206388","typename":"Image"},{"type":"id","generated":false,"id":"Image:206389","typename":"Image"},{"type":"id","generated":fal