enerated":true,"id":"Product:sp-142297.specificationGroups.0.specifications.5","typename":"SpecificationGroupProperty"}],"__typename":"SpecificationGroup"},"Product:sp-142297.specificationGroups.0.specifications.0":{"name":"Texto Curto PDP","originalName":"Texto Curto PDP","values":{"type":"json","json":["O Glossy Me Natural Rose Edition é perfeito para completar a sua maquiagem em qualquer ocasião, adicionando um toque de brilho e hidratação"]},"__typename":"SpecificationGroupProperty"},"Product:sp-142297.specificationGroups.0.specifications.1":{"name":"Sobre","originalName":"Sobre","values":{"type":"json","json":["O nosso querido gloss, também conhecido como brilho labial, é um item que não pode faltar na bolsa. Ele é \u003Cb\u003Esuper versátil\u003C\u002Fb\u003E e ajuda em todos os momentos do dia. A coleção \u003Ca href=\"https:\u002F\u002Fblog.oceane.com.br\u002Fmaquiagem\u002Foceane-edition\u002F\"\u003EOcéane Edition\u003C\u002Fa\u003E, apresenta o \u003Cb\u003EGlossy Me - Brilho Labial Natural Rose - Rosa Claro\u003C\u002Fb\u003E, uma tonalidade que vai conquistar o seu coração. Ele traz delicadeza e feminilidade ao visual, além de cuidar muito bem dos seus lábios.\u003Cbr\u003E\u003Cbr\u003EO produto contém \u003Cb\u003EÓleo de Esqualano\u003C\u002Fb\u003E em sua composição, ativo que ajuda na espalhabilidade do produto e auxilia na \u003Cb\u003Ehidratação labial\u003C\u002Fb\u003E. Sua textura é super confortável, não incomoda e ainda proporciona uma sensação agradável nos seus lábios. \u003Cbr\u003E\u003Cbr\u003EA cor Rosa Claro do Glossy Me é aquela opção versátil que vai transformar sua produção a qualquer hora do dia. Para o look casual, ele vai dar um \u003Cb\u003Ear leve e discreto\u003C\u002Fb\u003E para a sua \u003Cb\u003Emaquiagem\u003C\u002Fb\u003E. Já para a make mais elaborada, ele vai destacar sua boca com o maravilhoso efeito vitrificado. \u003Cbr\u003E\u003Cbr\u003EEle vem em uma embalagem com aplicador anatômico, ou seja, fica mais fácil aplicá-lo nos lábios. Além disso, ele é dosador e \u003Cb\u003Eimpede o desperdício\u003C\u002Fb\u003E de produto. Prático, versátil e lindo, o Glossy Me - Rosa Claro combina com qualquer estilo e qualquer ocasião. Não importa o dia nem a hora, com este gloss, você brilha como nunca e se torna o centro das atenções.\u003Cbr\u003E\u003Cbr\u003E\u003Ch2\u003EComo evitar que o gloss labial escorra ou borre?\u003C\u002Fh2\u003E\u003Cbr\u003EPara evitar que o gloss labial escorra ou borre,estragando a make, recomendamos não exagerar na quantidade de produto. Uma ótima dica é delinear os lábios com um lápis labial que se assemelhe à cor do gloss. Isso cria uma barreira e ajuda a não borrar.\u003Cbr\u003E\u003Cbr\u003E\u003Ch2\u003EQuais as vantagens do brilho labial?\u003C\u002Fh2\u003E\u003Cbr\u003EO brilho labial é um item compacto e você pode carregá-lo no seu \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fmaquiagem\u002Fnecessaire\"\u003Enécessaire\u003C\u002Fa\u003E, levando-o para todos os lugares. Ele dá aquele toque de \u003Cb\u003Ebrilho todo especial"]},"__typename":"SpecificationGroupProperty"},"Product:sp-142297.specificationGroups.0.specifications.2":{"name":"Característica principais PDP","originalName":"Característica principais PDP","values":{"type":"json","json":["O Glossy Me Natural Rose Edition é perfeito para completar a sua maquiagem em qualquer ocasião, adicionando um toque de brilho e hidratação. A sua fórmula contém Óleo de Esqualano para você cuidar dos lábios enquanto arrasa com um look incrível."]},"__typename":"SpecificationGroupProperty"},"Product:sp-142297.specificationGroups.0.specifications.3":{"name":"Como Usar","originalName":"Como Usar","values":{"type":"json","json":["\u003Ch2\u003EComo usar o meu Glossy Me?\u003C\u002Fh2\u003E\u003Cbr\u003EUse o aplicador do próprio produto para espalhar o Glossy Me Rosa Claro nos lábios. Espalhe bem, do centro para os cantos. Você pode controlar a quantidade depositada na pele pressionando o aplicador na boca. Use-o sozinho ou com o seu batom preferido.\u003Cbr\u003E"]},"__typename":"SpecificationGroupProperty"},"Product:sp-142297.specificationGroups.0.specifications.4":{"name":"Cuidados","originalName":"Cuidados","values":{"type":"json","json":["Em caso de irritabilidade suspenda o uso do brilho labial e procure auxílio médico. Manter o produto fechado em temperatura ambiente. Uso externo. Mantenha fora do alcance de crianças."]},"__typename":"SpecificationGroupProperty"},"Product:sp-142297.specificationGroups.0.specifications.5":{"name":"Composição","originalName":"Composição","values":{"type":"json","json":["Polyisobutene (Poli-Isobutileno), Isopropyl Myristate (Miristato De Isopropila), Squalane (Esqualano), Octyldodecanol (Octildodecanol), Dimer Dilinoleyl Dímer Dilinoleate (Dímero Dilinoleila Dímero Dilinoleato), Microcrystalline Wax (Cera Microcristalina), Silica Dimethyl Silylate (Sílica Dimetil Sililato), Hydrogenated Styrene\u002FIsoprene Copolymer (Copolímero De Estireno\u002FIsopreno Hidrogenado), Butylene Glycol Dicaprylate\u002FDicaprate (Dicaprilato\u002FDicaprato De Butilenoglicol), Mineral Oil (Óleo Mineral), Calcium Sodium Borosilicate (Bosossilicato De Cálcio E Sódio), Glyceryl Caprylate (Caprilato De Glicerila), Ci 77891 (Dióxido De Titânio) Synthetic Fluophlogopite (Fluorflogopita Sintética), Ci 77491 (Óxido De Ferro Vermelho), Parfum (Perfume), Ci 77492 (Óxido De Ferro Amarelo), Ci 77499 (Óxido De Ferro Preto),  Isopropyl Titanium Triisostearate (Isopropil Triisoestearato De Titânio), Tin Oxide (Óxido De Estanho), Pentaerythrityl Tetra-Di-T-Butyl Hydroxyhydrocinnamate ( Tetrabutil Pentaeritritil Hidroxihidrocinamato), Ci 15850 (Vermelho 57)."]},"__typename":"SpecificationGroupProperty"},"Product:sp-142297.specificationGroups.1":{"name":"allSpecifications","originalName":"allSpecifications","specifications":[{"type":"id","generated":true,"id":"Product:sp-142297.specificationGroups.1.specifications.0","typename":"SpecificationGroupPro