ra todos os lugares. Ele dá aquele toque de \u003Cb\u003Ebrilho todo especial"]},"__typename":"Property"},"Product:sp-142297.properties.2":{"name":"Característica principais PDP","values":{"type":"json","json":["O Glossy Me Natural Rose Edition é perfeito para completar a sua maquiagem em qualquer ocasião, adicionando um toque de brilho e hidratação. A sua fórmula contém Óleo de Esqualano para você cuidar dos lábios enquanto arrasa com um look incrível."]},"__typename":"Property"},"Product:sp-142297.properties.3":{"name":"Como Usar","values":{"type":"json","json":["\u003Ch2\u003EComo usar o meu Glossy Me?\u003C\u002Fh2\u003E\u003Cbr\u003EUse o aplicador do próprio produto para espalhar o Glossy Me Rosa Claro nos lábios. Espalhe bem, do centro para os cantos. Você pode controlar a quantidade depositada na pele pressionando o aplicador na boca. Use-o sozinho ou com o seu batom preferido.\u003Cbr\u003E"]},"__typename":"Property"},"Product:sp-142297.properties.4":{"name":"Cuidados","values":{"type":"json","json":["Em caso de irritabilidade suspenda o uso do brilho labial e procure auxílio médico. Manter o produto fechado em temperatura ambiente. Uso externo. Mantenha fora do alcance de crianças."]},"__typename":"Property"},"Product:sp-142297.properties.5":{"name":"Composição","values":{"type":"json","json":["Polyisobutene (Poli-Isobutileno), Isopropyl Myristate (Miristato De Isopropila), Squalane (Esqualano), Octyldodecanol (Octildodecanol), Dimer Dilinoleyl Dímer Dilinoleate (Dímero Dilinoleila Dímero Dilinoleato), Microcrystalline Wax (Cera Microcristalina), Silica Dimethyl Silylate (Sílica Dimetil Sililato), Hydrogenated Styrene\u002FIsoprene Copolymer (Copolímero De Estireno\u002FIsopreno Hidrogenado), Butylene Glycol Dicaprylate\u002FDicaprate (Dicaprilato\u002FDicaprato De Butilenoglicol), Mineral Oil (Óleo Mineral), Calcium Sodium Borosilicate (Bosossilicato De Cálcio E Sódio), Glyceryl Caprylate (Caprilato De Glicerila), Ci 77891 (Dióxido De Titânio) Synthetic F