8.productClusters.2":{"id":"246","name":"Full","__typename":"ProductClusters"},"Product:sp-142038.productClusters.3":{"id":"276","name":"Lançamento","__typename":"ProductClusters"},"Product:sp-142038.productClusters.4":{"id":"494","name":"Tudo de Maquiagem","__typename":"ProductClusters"},"Product:sp-142038.productClusters.5":{"id":"760","name":"Océane Edition","__typename":"ProductClusters"},"Product:sp-142038.productClusters.6":{"id":"783","name":"Vitrine Home I Queridinhos da Internet","__typename":"ProductClusters"},"Product:sp-142038.productClusters.7":{"id":"909","name":"Makes por até R$79,90","__typename":"ProductClusters"},"Product:sp-142038.productClusters.8":{"id":"959","name":"Sticks Edition","__typename":"ProductClusters"},"Product:sp-142038.productClusters.9":{"id":"966","name":"Aniversário Edition: 3 makes selecionadas por R$ 120","__typename":"ProductClusters"},"Product:sp-142038.productClusters.10":{"id":"984","name":"Océane Edition: Blush","__typename":"ProductClusters"},"Product:sp-142038.productClusters.11":{"id":"986","name":"Tudo Edition (- Kits)","__typename":"ProductClusters"},"Product:sp-142038.productClusters.12":{"id":"1003","name":"Vitrine Home | Lançamentos","__typename":"ProductClusters"},"Product:sp-142038.clusterHighlights.0":{"id":"276","name":"Lançamento","__typename":"ClusterHighlight"},"Product:sp-142038.properties.0":{"name":"Texto Curto PDP","values":{"type":"json","json":["O Blush em Bastão Rosa Claro Océane Edition é fácil de esfumar. Com alta pigmentação e fixação, com cera de candelila e óleo de semente de jojoba."]},"__typename":"Property"},"Product:sp-142038.properties.1":{"name":"Sobre","values":{"type":"json","json":["A maquiagem em bastão é tendência no mundo todo e, aqui na Océane, ela merece destaque na sua rotina de make. Conheça o \u003Cb\u003EBlush Stick Edition\u003C\u002Fb\u003E, um produto que traz um aspecto saudável e lindo para a sua pele, com \u003Cb\u003Eacabamento acetinado natural\u003C\u002Fb\u003E que combina com o seu dia. \u003Cbr\u003E\u003Cbr\u003EEste item faz parte da coleção de maquiagem \u003Ca href=\"https:\u002F\u002Fblog.oceane.com.br\u002Fmaquiagem\u002Foceane-edition\u002F\"\u003EOcéane Edition\u003C\u002Fa\u003E, que oferece produtos de beleza \u003Ci\u003Esmart\u003C\u002Fi\u003E para simplificar sua rotina de maquiagem. Para o dia ou para a noite, não importa a ocasião: ele vai deixar sua rotina de make completíssima, com aquela praticidade que a gente ama.\u003Cbr\u003E\u003Cbr\u003EO Blush Stick Edition está disponível na maravilhosa \u003Cb\u003Ecor Cloudy Pink\u003C\u002Fb\u003E, uma tonalidade rosa claro que proporciona um rubor saudável e uma dose de romantismo ao rosto. Sua \u003Cb\u003Ealta pigmentação e fixação duradoura\u003C\u002Fb\u003E, aliadas a uma textura cremosa, garantem uma cobertura uniforme de longa duração. Com ingredientes naturais como cera de candelila, óleo de oliva, ácido hialurônico e vitamina E, o produto oferece conforto durante a aplicação da \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fmaquiagem\"\u003EMaquiagem\u003C\u002Fa\u003E, além de ser super fácil de esfumar. \u003Cbr\u003E\u003Cbr\u003EDestaque ainda para a embalagem, que dá um show de praticidade, já que você nem precisa abrir para ver a cor do blush: ele possui um detalhe externo que mostra a cor do produto.\u003Cbr\u003E\u003Cbr\u003E\u003Ch2\u003EQuais pessoas podem usar o Blush Stick Edition?\u003C\u002Fh2\u003E\u003Cbr\u003EQualquer pessoa que queira realçar o rosto pode utilizar este produto. Seja a sua pele seca, mista ou oleosa, ele proporciona uma \u003Cb\u003Esensação agradável\u003C\u002Fb\u003E ao toque. Com \u003Cb\u003Epigmentação intensa\u003C\u002Fb\u003E, ideal para todos os tons de pele arrasarem na maquiagem.\u003Cbr\u003E\u003Cbr\u003E\u003Ch2\u003EPor que escolher maquiagem em bastão?\u003C\u002Fh2\u003E\u003Cbr\u003EA \u003Ca href=\"https:\u002F\u002Fblog.oceane.com.br\u002Fmaquiagem\u002Fmaquiagem-em-bastao-motivos-para-incluir-na-necessarie\u002F\"\u003Emaquiagem em bastão\u003C\u002Fa\u003E oferece versatilidade para o seu dia a dia, é fácil de carregar na sua bolsa (ocupando pouco espaço) e proporcio"]},"__typename":"Property"},"Product:sp-142038.properties.2":{"name":"Modelo","values":{"type":"json","json":["blush bastão maquiagem océane edition"]},"__typename":"Property"},"Product:sp-142038.properties.3":{"name":"Característica principais PDP","values":{"type":"json","json":["O Blush em Bastão Océane Edition Rosa Claro veio para facilitar a sua maquiagem, com acabamento acetinado natural, ele é super fácil de esfumar. Com alta pigmentação e fixação, conta com cera de candelila e óleo de semente de jojoba em sua composição."]},"__typename":"Property"},"Product:sp-142038.properties.4":{"name":"Como Usar","values":{"type":"json","json":["\u003Ch2\u003EComo fazer a aplicação do Blush Stick Edition\u003C\u002Fh2\u003E\u003Cbr\u003E\u003Cbr\u003EA aplicação do Blush Stick Edition é simples: aplique o produto direto nas maçãs do rosto com a intensidade desejada. Em seguida, utilize a \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fesponja-de-maquiagem-flat-drop-oceane-edition-ap2001056c001\u002Fp\"\u003EEsponja de Maquiagem Flat Drop Océane Edition\u003C\u002Fa\u003E ou os pincéis \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fpincel-de-maquiagem-angulado---soft-angled-brush-ocn2-ap2000758cuni\u002Fp\"\u003EOCN02\u003C\u002Fa\u003E, \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fpincel-para-blush-blush-brush-ap2000316cuni\u002Fp\"\u003EOCN03\u003C\u002Fa\u003E, \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fpincel-chanfrado-para-blush-pink-my-apple-n11-ap2000041cuni\u002Fp\"\u003EOCN05\u003C\u002Fa\u003E ou \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fpincel-de-maquiagem-para-iluminador---shimmer-brush-ocn6-ap2000759cuni\u002Fp\"\u003EOCN06\u003C\u002Fa\u003E para esfumar o produto até atingir o acabamento desejado.\u003Cbr\u003E\u003Cbr\u003EE para que o resultado fique do jeitinho que você espera, temos uma dica especial: use sempre o produto cremoso primeiro e só depois, aplique pó para selar sua make, combinado?"]},"__typename":"Property"},"Product:sp-142038.properties.5":{"name":"Cuidados","values":{"type":"json","json":["Dica: devido à sua fórmula mais emoliente, ao aplicar o Blush em Bastão Océane Edition, não é necessário girar muito a embalagem, dê apenas uma ou duas voltas para garantir uma aplicação confortável e sem risco de quebra do produto.\u003Cbr\u003EEm caso de irritabilidade, suspenda o uso e procure auxílio médico. Manter o produto em temperatura ambiente."]},"__typename":"Property"},"Product:sp-142038.properties.6":{"name":"Composição","values":{"type":"json","json":["DIISOSTEARYL MALATE (MALATO DE DIISOESTEARILA), POLYGLYCERYL-2 TRIISOSTEARATE (TRIISOESTEARATO DE POLIGLICERILA-2), OCTYLDODECANOL (OCTILDODECANOL), TRIETHYLHEXANOIN (TRIETILHEXANOÍNA), CI 77891 (CORANTE BRANCO 77891), ETHYLHEXYL PALMITATE (PALMITATO DE ETILEXILA), MICROCRYSTALLINE WAX (CERA MICROCRISTALINA), SYNTHETIC WAX (PARAFINA), SILICA (DIÓXIDO DE SILÍCIO), PARAFFIN (PARAFINA), CI 19140 (CORANTE AMARELO DE TARTRAZINA 19140), CI 15850 (CORANTE VERMELHO 15850), GLYCERYL CAPRYLATE (CAPRILATO DE GLICERILA), EUPHORBIA CERIFERA (CANDELILLA) WAX (CERA DE EUPHORBIA CERIFERA (CANDELILA)), CI 45410 (CORANTE VERMELHO 45410), TOCOPHERYL ACETATE (ACETATO DE TOCOFERILA), PHYTOSTERYL ISOSTEARATE (ISOESTEARATO DE FITOSTERILA), OLEA EUROPAEA (OLIVE) FRUIT OIL (ÓLEO DA FOLHA DE OLIVEIRA), RICINUS COMMUNIS (CASTOR) SEED OIL (ÓLEO DE RÍCINO), SODIUM HYALURONATE (HIALURONATO DE SÓDIO), CERAMIDE NP (CERAMIDA NP), HYDROGENATED CASTOR OIL (ÓLEO DE RÍCINO HIDROGENADO), TRIETHOXYCAPRYLYLSILANE (TRIETOXICAPRILILSILANO), PARFUM (PERFUME), BHT (BUTIL-HIDROXITOLUENO)."]},"__typename":"Property"},"Product:sp-142038.properties.7":{"name":"Departamento","values":{"type":"json","json":["Feminino"]},"__typename":"Property"},"Product:sp-142038.prop