rty"},"Product:sp-101890.specificationGroups.1":{"name":"Selos","originalName":"Selos","specifications":[{"type":"id","generated":true,"id":"Product:sp-101890.specificationGroups.1.specifications.0","typename":"SpecificationGroupProperty"}],"__typename":"SpecificationGroup"},"Product:sp-101890.specificationGroups.1.specifications.0":{"name":"Selos","originalName":"Selos","values":{"type":"json","json":["Cruelty Free","Vegano"]},"__typename":"SpecificationGroupProperty"},"Product:sp-101890.specificationGroups.2":{"name":"Características principais PDP","originalName":"Características principais PDP","specifications":[{"type":"id","generated":true,"id":"Product:sp-101890.specificationGroups.2.specifications.0","typename":"SpecificationGroupProperty"},{"type":"id","generated":true,"id":"Product:sp-101890.specificationGroups.2.specifications.1","typename":"SpecificationGroupProperty"},{"type":"id","generated":true,"id":"Product:sp-101890.specificationGroups.2.specifications.2","typename":"SpecificationGroupProperty"},{"type":"id","generated":true,"id":"Product:sp-101890.specificationGroups.2.specifications.3","typename":"SpecificationGroupProperty"},{"type":"id","generated":true,"id":"Product:sp-101890.specificationGroups.2.specifications.4","typename":"SpecificationGroupProperty"},{"type":"id","generated":true,"id":"Product:sp-101890.specificationGroups.2.specifications.5","typename":"SpecificationGroupProperty"},{"type":"id","generated":true,"id":"Product:sp-101890.specificationGroups.2.specifications.6","typename":"SpecificationGroupProperty"}],"__typename":"SpecificationGroup"},"Product:sp-101890.specificationGroups.2.specifications.0":{"name":"Texto Curto PDP","originalName":"Texto Curto PDP","values":{"type":"json","json":["O Batom The Lipstick Nude Pink Océane Edition possui o tom de rosa perfeito e acabamento semi-matte, fica super confortável nos lábios. Confira!"]},"__typename":"SpecificationGroupProperty"},"Product:sp-101890.specificationGroups.2.specifications.1":{"name":"Sobre","originalName":"Sobre","values":{"type":"json","json":["Se a gente pedisse para você escolher um item de maquiagem que você não pode viver sem, certamente o \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002FMaquiagem\u002Fboca\u002Fbatom\"\u003Ebatom\u003C\u002Fa\u003E seria um deles. Afinal, ele costuma ser o primeiro item de make de muitas pessoas. Pensando nisso, o The Lipstick chega para ocupar um lugar no seu \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fnecessaire\"\u003Enécessaire\u003C\u002Fa\u003E e no seu coração. Vem ver os benefícios:\u003Cbr\u003E\u003Cbr\u003EO primeiro destaque fica por conta da sua \u003Cb\u003Ecobertura semi-matte, que é muito confortável\u003C\u002Fb\u003E e não craquela, além de possuir uma durabilidade incrível. A cor Nude Pink - Rosa é aquele tom que traz delicadeza e feminilidade ao look, deixando seus lábios rosados e lindos.\u003Cbr\u003E\u003Cbr\u003EEspecialista em maquiagem de qualidade, a \u003Ca href=\"https:\u002F\u002Fblog.oceane.com.br\u002Fmaquiagem\u002Foceane-edition\u002F\"\u003Elinha Océane Edition\u003C\u002Fa\u003E combina com todos os momentos do seu dia. E a tonalidade Nude Pink - Rosa do The Lipstick ainda conta com óleo de girassol, óleo de amêndoas e ácido hialurônico, ingredientes que o tornam ainda mais fáceis de espalhar. Tudo de bom, né? \u003Cbr\u003E\u003Cbr\u003EPode parar de procurar: o batom certo para deixar seus lábios lindos e rosados por mais tempo está aqui! Com ele, sua boca ganha aquele aspecto uniforme na tonalidade rosada sofisticada e discreta que combina com qualquer ocasião. Seja para trabalhar, para o happy hour ou para um encontro a dois, tenha este batom na bolsa e garanta o visual sempre intacto aonde quer que esteja.\u003Cbr\u003E\u003Cbr\u003E\u003Cbr\u003E\u003Ch2\u003EEste batom combina com quais ocasiões?\u003C\u002Fh2\u003E\u003Cbr\u003ETodas! Nude Pink - Rosa é uma cor coringa em qualquer nécessaire. Ele passa uma mensagem doce e delicada, para os dias que você quer se sentir mais feminina. Além disso ele é super elegante e pode ser usado para compor uma make de trabalho e até mesmo um look de festa."]},"__typename":"SpecificationGroupProperty"},"Product:sp-101890.specificationGroups.2.specifications.2":{"name":"Modelo","originalName":"Modelo","values":{"type":"json","json":["Batom The Lipstick Nude Pink Océane Edition rosa semi-matte"]},"__typename":"SpecificationGroupProperty"},"Product:sp-101890.specificationGroups.2.specifications.3":{"name":"Característica principais PDP","originalName":"Característica principais PDP","values":{"type":"json","json":["O Batom The Lipstick Nude Pink possui o tom de rosa perfeito e acabamento semi-matte e fica super confortável nos lábios. Sua fórmula vegana e cruelty free possui Óleo de Girassol, Óleo de Amêndoas e Ácido Hialurônico."]},"__typename":"SpecificationGroupProperty"},"Product:sp-101890.specificationGroups.2.specifications.4":{"name":"Como Usar","originalName":"Como Usar","values":{"type":"json","json":["\u003Ch2\u003EComo aplicar The Lipstick?\u003C\u002Fh2\u003E\u003Cbr\u003EMuito fácil! Você pode passar o produto diretamente sobre os lábios, sempre do centro para as extremidades. Ou, se desejar um acabamento mais profissional, use o \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fpincel-de-maquiagem-para-sombra-smoke-my-eyes-n36-ap2000036cuni\u002Fp\"\u003EPincel Ocn12\u003C\u002Fa\u003E para espalhá-lo com precisão. \u003Cbr\u003E\u003Cbr\u003EVocê pode ainda fazer um contorno labial usando o \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fpincel-de-maquiagem-delineador-kitty-my-eyes-ba12-ap2000372cuni\u002Fp\"\u003EPincel Ocn15\u003C\u002Fa\u003E ou dar um acabamento molhado usando o Glossy Me sobre o The Lipstick.\u003Cbr\u003E\u003Cbr\u003E\u003Cbr\u003E\u003Ch2\u003EComo aumentar a durabilidade do batom na boca?\u003C\u002Fh2\u003E\u003Cbr\u003EApesar da incrível durabilidade do The Lipstick, há sempre alguns \u003Ca href=\"htt