ion\u003C\u002Fa\u003E combina com todos os momentos do seu dia. E a tonalidade Nude Pink - Rosa do The Lipstick ainda conta com óleo de girassol, óleo de amêndoas e ácido hialurônico, ingredientes que o tornam ainda mais fáceis de espalhar. Tudo de bom, né? \u003Cbr\u003E\u003Cbr\u003EPode parar de procurar: o batom certo para deixar seus lábios lindos e rosados por mais tempo está aqui! Com ele, sua boca ganha aquele aspecto uniforme na tonalidade rosada sofisticada e discreta que combina com qualquer ocasião. Seja para trabalhar, para o happy hour ou para um encontro a dois, tenha este batom na bolsa e garanta o visual sempre intacto aonde quer que esteja.\u003Cbr\u003E\u003Cbr\u003E\u003Cbr\u003E\u003Ch2\u003EEste batom combina com quais ocasiões?\u003C\u002Fh2\u003E\u003Cbr\u003ETodas! Nude Pink - Rosa é uma cor coringa em qualquer nécessaire. Ele passa uma mensagem doce e delicada, para os dias que você quer se sentir mais feminina. Além disso ele é super elegante e pode ser usado para compor uma make de trabalho e até mesmo um look de festa."]},"__typename":"SpecificationGroupProperty"},"Product:sp-101890.specificationGroups.3.specifications.2":{"name":"Modelo","originalName":"Modelo","values":{"type":"json","json":["Batom The Lipstick Nude Pink Océane Edition rosa semi-matte"]},"__typename":"SpecificationGroupProperty"},"Product:sp-101890.specificationGroups.3.specifications.3":{"name":"Característica principais PDP","originalName":"Característica principais PDP","values":{"type":"json","json":["O Batom The Lipstick Nude Pink possui o tom de rosa perfeito e acabamento semi-matte e fica super confortável nos lábios. Sua fórmula vegana e cruelty free possui Óleo de Girassol, Óleo de Amêndoas e Ácido Hialurônico."]},"__typename":"SpecificationGroupProperty"},"Product:sp-101890.specificationGroups.3.specifications.4":{"name":"Como Usar","originalName":"Como Usar","values":{"type":"json","json":["\u003Ch2\u003EComo aplicar The Lipstick?\u003C\u002Fh2\u003E\u003Cb