755.specificationGroups.0.specifications.1":{"name":"Sobre","originalName":"Sobre","values":{"type":"json","json":["As makes multifuncionais estão com tudo e o Lip Tint Edition Océane é um desses produtos que você precisa conhecer! Versátil e prático, ele \u003Cb\u003Edeixa sua make suave e com aquele ar saudável\u003C\u002Fb\u003E que a gente adora! \u003Cbr\u003E\u003Cbr\u003EEntre os seus vários jeitos de usar, você pode contar com ele para produzir uma make e usar tanto nos \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fskincare\u002Flabios\"\u003ELábios\u003C\u002Fa\u003E, quanto para as maçãs do rosto, sabia? \u003Cbr\u003E\u003Cbr\u003EAgora, vamos falar da pigmentação deste produto, que é incrível. \u003Cb\u003ESeu tom Pink combina com diversos tons de pele\u003C\u002Fb\u003E e é perfeito para deixar seus lábios lindos. Com ele, você vai arrasar em todas as ocasiões! \u003Cbr\u003E\u003Cbr\u003ECom alta duração, você pode usar este produto para complementar a sua \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fmaquiagem\"\u003EMaquiagem\u003C\u002Fa\u003E, seja no seu dia a dia de trabalho, academia ou quando você quiser dar um up no visual. O Lip Tint Edition trata intensamente os lábios, já que sua fórmula é rica em ácido hialurônico e cica, \u003Cb\u003Eativos que hidratam e reparam a sua pele\u003C\u002Fb\u003E e são ótimos para ter em sua rotina. \u003Cbr\u003E\u003Cbr\u003E\u003Ch2\u003EQuais os benefícios do Lip Tint Océane?\u003C\u002Fh2\u003E\u003Cbr\u003EO Lip Tint Edition entrega uma cor suave, que pode ser mais ou menos intensa, a depender da quantidade de camadas aplicadas. \u003Cbr\u003E\u003Cbr\u003ESeus ativos inteligentes cuidam de sua pele durante o uso, unindo make e tratamento em um produto que não pode ficar de fora da sua rotina. Quer saber como?\u003Cbr\u003E\u003Cbr\u003E\u003Ch3\u003EÁcido Hialurônico\u003C\u002Fh3\u003E\u003Cbr\u003E\u003Cbr\u003EEsse ativo a gente tem certeza que você já conhece! Responsável por hidratar a nossa pele - afinal, hidratação nunca é demais, né? - \u003Cb\u003Eo ácido hialurônico preenche e dá firmeza, retendo a água nas suas células\u003C\u002Fb\u003E.\u003Cbr\u003E\u003Cbr\u003EEle também preenche aqueles vincos, o que traz uma sensação de boca suave, menos irritada e sem descascar. O resultado são \u003Cb\u003Elábios hidratados, macios e livres do ressecamento\u003C\u002Fb\u003E.\u003Cbr\u003E\u003Cbr\u003E\u003Cbr\u003E\u003Ch3\u003ECica\u003C\u002Fh3\u003E\u003Cbr\u003E\u003Cbr\u003EVocê já ouviu falar da cica? Também conhecida como centella asiática, a cica é um ingrediente antioxidante que es"]},"__typename":"SpecificationGroupProperty"},"Product:sp-61755.specificationGroups.0.specifications.2":{"name":"Modelo","originalName":"Modelo","values":{"type":"json","json":["Maquiagem Balm Brilho Labial Rosa Lip Tinted Pink Océane Edition"]},"__typename":"SpecificationGroupProperty"},"Product:sp-61755.specificationGroups.0.specifications.3":{"name":"Característica principais PDP","originalName":"Característica principais PDP","values":{"type":"json","json":["O Lip Tint Océane Edition é um produto multifuncional indispensável no seu nécessaire, pode ser usado nos lábios e nas maçãs do rosto. Sua fórmula vegana e cruelty free conta com Ácido Hialurônico e Cica."]},"__typename":"SpecificationGroupProperty"},"Product:sp-61755.specificationGroups.0.specifications.4":{"name":"Como Usar","originalName":"Como Usar","values":{"type":"json","json":["\u003Ch2\u003EComo usar o seu Lip Tint Océane?\u003C\u002Fh2\u003E \u003Cbr\u003E\u003Cbr\u003EO Lip Tint é super fácil e rápido de aplicar, com uma textura que espalha bem e não acumula, deixando sua \u003Ca href=\"https:\u002F\u002Fwww.oceane.com.br\u002Fmaquiagem\u002Fboca\"\u003EBoca\u003C\u002Fa\u003E com um aspecto super natural. \u003Cb\u003ESeu pincel anatômico é pensado para facilitar a aplicação nos lábios com conforto e precisão\u003C\u002Fb\u003E. \u003Cbr\u003E\u003Cbr\u003ESe você optar por utilizar o seu Lip Tint Edition como blush, basta aplicar pequenas gotinhas na região e esfumar com os dedos dando leves batidinhas. \u003Cbr\u003E\u003Cbr\u003ECaso queira construir camadas, só seguir os mesmos passos até chegar na tonalidade desejada!"]},"__typename":"SpecificationGroupProperty"},"Product:sp-61755.specificationGroups.0.specifications.5":{"name":"Cuidados","originalName":"Cuidados","values":{"type":"json","json":["Em caso de irritabilidade, suspenda o uso e procure auxílio médico. Manter o produto fechado em temperatura ambiente. Não armazenar em local úmido ou mal ventilado. Uso externo. Mantenha fora do alcance de crianças."]},"__typename":"SpecificationGroupProperty"},"Product:sp-61755.specificationGroups.0.specifications.6":{"name":"Composição","originalName":"Composição","values":{"type":"json","json":["AQUA, PROPANEDIOL, GLYCERIN, POLYSORBATE 20, ACRYLATES COPOLYMER, PHENOXYETHANOL, ACRYLATES\u002FC10-30 ALKYL ACRYLATE CROSSPOLYMER, CHLORPHENESIN, HYDROXYETHYLCELLULOSE, CI 45410, PARFUM, GLYCERYL ACRYLATE\u002FACRYLIC ACID COPOLYMER, CI 17200, AMINOMETHYL, PROPANEDIOL, BUTYLENE GLYCOL, PROPYLENE GLYCOL, CENTELLA ASIATICA EXTRACT, SODIUM DEHYDROACETATE, PENTYLENE GLYCOL, SOPHORA JAPONICA BUD EXTRACT, SODIUM HYALURONATE, SODIUM ACETYLATED HYALURONATE, GLYCYRRHIZA URALENSIS ROOT EXTRACT, CAMELLIA JAPONICA FLOWER EXTRACT, MAGNOLIA DENUDATE FLOWER EXTRACT, SODIUM HYALURONATE CROSSPOLYMER, HYDROLYZED SODIUM HYALURONATE, ETHYLHEXYLGLYCERIN."]},"__typename":"SpecificationGroupProperty"},"Product:sp-61755.specificationGroups.1":{"name":"Selos","originalName":"Selos","specifications":[{"type":"id","generated":true,"id":"Product:sp-61755.specificationGroups.1.specifications.0","typename":"SpecificationGroupProperty"}],"__typename":"SpecificationGroup"},"Product:sp-61755.specificationGroups.1.specifications.0":{"name":"Selos","originalName":"Selos","values":{"type":"json","json":["Cruelty Free","Vegano"]},"__typename":"SpecificationGroupProperty"},"Product:sp-61